INSERT INTO `settings` (`id`, `title`, `slug`, `image`, `value`, `created_at`, `updated_at`) VALUES
(1, 'Privacy policy', 'privacy-policy', NULL, '<h1 style=\"padding: 0px; margin-right: 0px; margin-bottom: 0px; margin-left: 0px; border: 0px solid rgb(228, 228, 228); font-family: Asap; font-size: 39.6px; color: rgb(51, 51, 51);\">TERMS &amp; CONDITIONS of GIRLFRIEND SOCIAL</h1><p style=\"padding: 0px; margin-bottom: 11.5px; border: 0px solid rgb(228, 228, 228); font-family: Muli; color: rgb(51, 51, 51); font-size: 18px;\">Girlfriend Social provides a way for women to meet and become friends with other women, while enjoying fun and new activities. This is a legal agreement (\"Agreement\") between you and Girlfriend Social. Please read the Agreement carefully before registering. By registering, you become a member of Girlfriend Social and you agree to be bound by the terms and conditions of this Agreement (the \"Terms\") for as long as you continue to be a Member. If you do not agree to the terms, please do not register for Girlfriend Social. The terms are subject to change by Girlfriend Social at any time, effective upon notice to you.</p><p style=\"padding: 0px; margin-bottom: 11.5px; border: 0px solid rgb(228, 228, 228); font-family: Muli; color: rgb(51, 51, 51); font-size: 18px;\"><i style=\"padding: 0px; margin: 0px; border: 0px solid rgb(228, 228, 228);\">If you have been linked to this page for account abuse, pay close attention to the following area as it means you\'ve likely done some of the below. We will remove accounts who we find are doing any of the following:</i></p><h1 style=\"padding: 0px; margin-right: 0px; margin-bottom: 0px; margin-left: 0px; border: 0px solid rgb(228, 228, 228); font-family: Asap; font-size: 39.6px; color: rgb(51, 51, 51);\">General \"Don\'t Do These Things\" Girlfriend Social Rules</h1><ul style=\"padding: 0px; margin-right: 0px; margin-bottom: 0px; margin-left: 0px; border: 0px solid rgb(228, 228, 228); font-family: Muli; list-style-type: none; color: rgb(51, 51, 51); font-size: 18px;\"><li style=\"padding: 0px; margin: 0px; border: 0px solid rgb(228, 228, 228);\">* Insult, Abuse, Flame or attack other members in message or on your profile</li><li style=\"padding: 0px; margin: 0px; border: 0px solid rgb(228, 228, 228);\">* Post personally identifiable information (i.e. name, address, email, phone number, etc.) of another member</li><li style=\"padding: 0px; margin: 0px; border: 0px solid rgb(228, 228, 228);\">* Repeatedly reporting users you just don\'t like, instead of blocking them, ignoring them and moving on like an adult</li><li style=\"padding: 0px; margin: 0px; border: 0px solid rgb(228, 228, 228);\">* Mass bully group up and reporting a member you don\'t like. 1 Issue, 1 Report</li><li style=\"padding: 0px; margin: 0px; border: 0px solid rgb(228, 228, 228);\">* Openly arguing with a moderator or GFS staff</li><li style=\"padding: 0px; margin: 0px; border: 0px solid rgb(228, 228, 228);\">* Mass Spamming users</li><li style=\"padding: 0px; margin: 0px; border: 0px solid rgb(228, 228, 228);\">* Threats of violence or harassment, even as a joke</li><li style=\"padding: 0px; margin: 0px; border: 0px solid rgb(228, 228, 228);\">* Racism, discrimination, hate speech</li><li style=\"padding: 0px; margin: 0px; border: 0px solid rgb(228, 228, 228);\">* Abusive language, including excessive swearing</li><li style=\"padding: 0px; margin: 0px; border: 0px solid rgb(228, 228, 228);\">* Religious, political, and other “prone to huge arguments” threads that you keep pushing</li><li style=\"padding: 0px; margin: 0px; border: 0px solid rgb(228, 228, 228);\">* Asking users for money on the site</li><li style=\"padding: 0px; margin: 0px; border: 0px solid rgb(228, 228, 228);\">* Post links to phishing sites</li><li style=\"padding: 0px; margin: 0px; border: 0px solid rgb(228, 228, 228);\">* Re-post Closed, Modified, Deleted Content Or Recreating Banned Accounts</li><li style=\"padding: 0px; margin: 0px; border: 0px solid rgb(228, 228, 228);\">* Recruiting members to competing websites - Meetup, WhatsApp, Other Websites/Friendship sites, Etc.</li><li style=\"padding: 0px; margin: 0px; border: 0px solid rgb(228, 228, 228);\">* Porn, inappropriate or offensive content, or anything else not safe for work</li><li style=\"padding: 0px; margin: 0px; border: 0px solid rgb(228, 228, 228);\">* Selling, Soliciting, begging, affiliate, auctioning, raffling, advertising, referrals of any kind</li></ul><p><br style=\"padding: 0px; margin: 0px; border: 0px solid rgb(228, 228, 228); font-family: Muli; clear: both; color: rgb(51, 51, 51); font-size: 18px;\"><span style=\"color: rgb(51, 51, 51); font-family: Muli; font-size: 18px;\">Basically&nbsp;</span><span style=\"padding: 0px; margin: 0px; border: 0px solid rgb(228, 228, 228); font-family: Muli; font-weight: 700; color: rgb(51, 51, 51); font-size: 18px;\">we are all adults here</span><span style=\"color: rgb(51, 51, 51); font-family: Muli; font-size: 18px;\">. You may not get along with everyone, but we are a free to use friendship website, Not a baby sitting service to figure out your personal \"I don\'t like her\" disputes. Use the block button and learn to ignore other members who you don\'t like. Constantly engaging and continuing arguments with GFS members you do not like is not productive for anyone when you could just as easily ignore the members you just don\'t get along with. Be the bigger person. We investigate all abuse reports seriously and will remove anyone as we see fit. The rest of this document contains additional reasons for removal and more legal terms. By using GFS you agree to all terms of this document.</span></p><p style=\"padding: 0px; margin-bottom: 11.5px; border: 0px solid rgb(228, 228, 228); font-family: Muli; color: rgb(51, 51, 51); font-size: 18px;\"></p><p><br style=\"padding: 0px; margin: 0px; border: 0px solid rgb(228, 228, 228); font-family: Muli; clear: both; color: rgb(51, 51, 51); font-size: 18px;\"></p><h4 style=\"padding: 10px 0px; margin-right: 0px; margin-bottom: 10px; margin-left: 0px; border-image: initial; border-style: solid; border-width: 0px 0px 1px; border-color: rgb(228, 228, 228); font-family: Asap; color: rgb(236, 0, 142); font-size: 16.2px;\">MINORS MAY NOT BECOME MEMBERS.</h4><p style=\"padding: 0px; margin-bottom: 11.5px; border: 0px solid rgb(228, 228, 228); font-family: Muli; color: rgb(51, 51, 51); font-size: 18px;\">By becoming a Member, you represent and warrant that you are at least 18 years old.</p><p style=\"padding: 0px; margin-bottom: 11.5px; border: 0px solid rgb(228, 228, 228); font-family: Muli; color: rgb(51, 51, 51); font-size: 18px;\"></p><h4 style=\"padding: 10px 0px; margin-right: 0px; margin-bottom: 10px; margin-left: 0px; border-image: initial; border-style: solid; border-width: 0px 0px 1px; border-color: rgb(228, 228, 228); font-family: Asap; color: rgb(236, 0, 142); font-size: 16.2px;\">ACCURATE INFORMATION</h4><p style=\"padding: 0px; margin-bottom: 11.5px; border: 0px solid rgb(228, 228, 228); font-family: Muli; color: rgb(51, 51, 51); font-size: 18px;\"></p><p style=\"padding: 0px; margin-bottom: 11.5px; border: 0px solid rgb(228, 228, 228); font-family: Muli; color: rgb(51, 51, 51); font-size: 18px;\">In consideration of your use of the Site, you agree to (a) provide accurate, current and complete information about you as may be prompted by any registration forms on the Site (\"Registration Data\"); (b) maintain the security of your password and identification; (c) maintain and promptly update the Registration Data, and any other information you provide to Company, to keep it accurate, current and complete; (d) be fully responsible for all use of your account and for any actions that take place using your account; and (e) You may not register for more than one User account, register for a User account on behalf of an individual other than yourself, or register for a User account on behalf of any group or entity;</p><h4 style=\"padding: 10px 0px; margin-right: 0px; margin-bottom: 10px; margin-left: 0px; border-image: initial; border-style: solid; border-width: 0px 0px 1px; border-color: rgb(228, 228, 228); font-family: Asap; color: rgb(236, 0, 142); font-size: 16.2px;\">OPTIONAL GFS VIP UPGRADES</h4><p style=\"padding: 0px; margin-bottom: 11.5px; border: 0px solid rgb(228, 228, 228); font-family: Muli; color: rgb(51, 51, 51); font-size: 18px;\">There is no refund for any optional upgrades (gold or diamond membership) on Girlfriend Social. .<br style=\"padding: 0px; margin: 0px; border: 0px solid rgb(228, 228, 228); clear: both;\">Considering the digital nature of Girlfriend Social upgrades, there is no refund in situations like the following:<br style=\"padding: 0px; margin: 0px; border: 0px solid rgb(228, 228, 228); clear: both;\"></p><ul style=\"padding: 0px; margin-right: 0px; margin-bottom: 0px; margin-left: 0px; border: 0px solid rgb(228, 228, 228); font-family: Muli; list-style-type: none; color: rgb(51, 51, 51); font-size: 18px;\"><li style=\"padding: 0px; margin: 0px; border: 0px solid rgb(228, 228, 228);\">you have changed your mind about an upgrade;</li><li style=\"padding: 0px; margin: 0px; border: 0px solid rgb(228, 228, 228);\">you bought an upgrade by mistake;</li><li style=\"padding: 0px; margin: 0px; border: 0px solid rgb(228, 228, 228);\">you \'forgot\' to cancel your upgrade before it is automatically renewed;</li><li style=\"padding: 0px; margin: 0px; border: 0px solid rgb(228, 228, 228);\">you ask for goodwill about an upgrade and/or refunds;</li></ul><p><br style=\"padding: 0px; margin: 0px; border: 0px solid rgb(228, 228, 228); font-family: Muli; clear: both; color: rgb(51, 51, 51); font-size: 18px;\"><br style=\"padding: 0px; margin: 0px; border: 0px solid rgb(228, 228, 228); font-family: Muli; clear: both; color: rgb(51, 51, 51); font-size: 18px;\"><span style=\"color: rgb(51, 51, 51); font-family: Muli; font-size: 18px;\">We do not offer refunds since this upgrade is completely optional and you receive the benefits immediately. We use these upgrades for improvements and advertising around the site to help it grow and stay working. Your account will not be able to be deleted until your paid upgrade is over. Once it is finished you can delete your account at any time.</span><br style=\"padding: 0px; margin: 0px; border: 0px solid rgb(228, 228, 228); font-family: Muli; clear: both; color: rgb(51, 51, 51); font-size: 18px;\"><br style=\"padding: 0px; margin: 0px; border: 0px solid rgb(228, 228, 228); font-family: Muli; clear: both; color: rgb(51, 51, 51); font-size: 18px;\"><span style=\"color: rgb(51, 51, 51); font-family: Muli; font-size: 18px;\">Please do not file complaints with Paypal as the charges were authorized by you, even if you forgot, and we have to devote additional time and resources to proving there has been no fraud. If you have concerns, please email us and we will go over it. Fraud charges with Paypal when there has been no fraud helps no one. We appreciate anyone who upgrades and thank them for their support, but please do not upgrade unless you understand these terms.</span></p><p style=\"padding: 0px; margin-bottom: 11.5px; border: 0px solid rgb(228, 228, 228); font-family: Muli; color: rgb(51, 51, 51); font-size: 18px;\"></p><p><br style=\"padding: 0px; margin: 0px; border: 0px solid rgb(228, 228, 228); font-family: Muli; clear: both; color: rgb(51, 51, 51); font-size: 18px;\"></p><h4 style=\"padding: 10px 0px; margin-right: 0px; margin-bottom: 10px; margin-left: 0px; border-image: initial; border-style: solid; border-width: 0px 0px 1px; border-color: rgb(228, 228, 228); font-family: Asap; color: rgb(236, 0, 142); font-size: 16.2px;\">TERMINATION OF ACCOUNT</h4><p style=\"padding: 0px; margin-bottom: 11.5px; border: 0px solid rgb(228, 228, 228); font-family: Muli; color: rgb(51, 51, 51); font-size: 18px;\"><br style=\"padding: 0px; margin: 0px; border: 0px solid rgb(228, 228, 228); clear: both;\">Either party may terminate this Agreement at any time by notifying the other party (or by the user deleting their account). Girlfriend Social Members are required to remove their OWN account via the settings menu for security reasons. Girlfriend Social may also terminate or suspend your access to or ability to use any and all Services or events immediately, without prior notice or liability, for any reason or no reason, including but not limited to if you breach any of the terms or conditions of this Agreement. In particular, Girlfriend Social may immediately terminate or suspend Accounts that have been flagged for abuse, repeat complaints, or found to not be in the spirit of the website. Upon termination of your access to or ability to use a Service, including but not limited to suspension of your Account on a Service, your right to use or access that Service and any Content will immediately cease. All provisions of this Agreement which by their nature should survive termination shall survive termination, including, without limitation, ownership provisions, warranty disclaimers, and limitations of liability. Termination of your access to and use of the Services shall not relieve you of any obligations arising or accruing prior to such termination or limit any liability which you otherwise may have to Girlfriend Social or any third party. Your membership to Girlfriend Social service is for your sole, personal use. You may not authorize others to use your membership, and you may not assign or otherwise transfer your account to any other person or entity.</p><h4 style=\"padding: 10px 0px; margin-right: 0px; margin-bottom: 10px; margin-left: 0px; border-image: initial; border-style: solid; border-width: 0px 0px 1px; border-color: rgb(228, 228, 228); font-family: Asap; color: rgb(236, 0, 142); font-size: 16.2px;\">Legal Disputes</h4><p><span style=\"color: rgb(51, 51, 51); font-family: Muli; font-size: 18px;\">You and Girlfriend Social agree that we will resolve any claim or controversy at law or equity that arises out of this Agreement or the Services in accordance with this Section or as you and Girlfriend Social otherwise agree in writing. Before resorting to litigation, we strongly encourage you to contact us directly to seek a resolution.</span></p><h4 style=\"padding: 10px 0px; margin-right: 0px; margin-bottom: 10px; margin-left: 0px; border-image: initial; border-style: solid; border-width: 0px 0px 1px; border-color: rgb(228, 228, 228); font-family: Asap; color: rgb(236, 0, 142); font-size: 16.2px;\">Law and Forum for Legal Disputes</h4><p><span style=\"color: rgb(51, 51, 51); font-family: Muli; font-size: 18px;\">This Agreement shall be governed in all respects by the laws of the Province of Ontario as they apply to agreements entered into and to be performed entirely within Ontario between Ontario residents, without regard to conflict of law provisions. You agree that any claim or dispute you may have against Girlfriend Social must be resolved exclusively by a provincial or federal court located in Ontario, Canada except as otherwise agreed by the parties. You agree to submit to the personal jurisdiction of the courts located within Ontario, Canada for the purpose of litigating all such claims or disputes.</span></p><h4 style=\"padding: 10px 0px; margin-right: 0px; margin-bottom: 10px; margin-left: 0px; border-image: initial; border-style: solid; border-width: 0px 0px 1px; border-color: rgb(228, 228, 228); font-family: Asap; color: rgb(236, 0, 142); font-size: 16.2px;\">INDEMNITY BY MEMBER:</h4><p style=\"padding: 0px; margin-bottom: 11.5px; border: 0px solid rgb(228, 228, 228); font-family: Muli; color: rgb(51, 51, 51); font-size: 18px;\"><br style=\"padding: 0px; margin: 0px; border: 0px solid rgb(228, 228, 228); clear: both;\">You will defend, indemnify, and hold harmless Girlfriend Social, its officers, directors, employees, agents and third parties, for any losses, costs, liabilities and expenses (including reasonable attorneys\' fees) relating to or arising out of your use of Girlfriend Social service, including any breach by you of the terms of this Agreement.</p><h4 style=\"padding: 10px 0px; margin-right: 0px; margin-bottom: 10px; margin-left: 0px; border-image: initial; border-style: solid; border-width: 0px 0px 1px; border-color: rgb(228, 228, 228); font-family: Asap; color: rgb(236, 0, 142); font-size: 16.2px;\">INFORMATION SUPPLIED BY MEMBER:</h4><p style=\"padding: 0px; margin-bottom: 11.5px; border: 0px solid rgb(228, 228, 228); font-family: Muli; color: rgb(51, 51, 51); font-size: 18px;\"><br style=\"padding: 0px; margin: 0px; border: 0px solid rgb(228, 228, 228); clear: both;\">Girlfriend Social will keep confidential all information supplied by you to Girlfriend Social, and shall use or disclose such information only for the purposes for which such information was collected, or as required by law. Please see Privacy Statement for more detailed information concerning confidentiality.</p><h4 style=\"padding: 10px 0px; margin-right: 0px; margin-bottom: 10px; margin-left: 0px; border-image: initial; border-style: solid; border-width: 0px 0px 1px; border-color: rgb(228, 228, 228); font-family: Asap; color: rgb(236, 0, 142); font-size: 16.2px;\">COMPLAINTS:</h4><p style=\"padding: 0px; margin-bottom: 11.5px; border: 0px solid rgb(228, 228, 228); font-family: Muli; color: rgb(51, 51, 51); font-size: 18px;\"><br style=\"padding: 0px; margin: 0px; border: 0px solid rgb(228, 228, 228); clear: both;\">To resolve a complaint regarding Girlfriend Social service, you should first contact us, by clicking on the \"Contact Us\" button. We will do everything in our power to resolve complaints fairly.</p><h4 style=\"padding: 10px 0px; margin-right: 0px; margin-bottom: 10px; margin-left: 0px; border-image: initial; border-style: solid; border-width: 0px 0px 1px; border-color: rgb(228, 228, 228); font-family: Asap; color: rgb(236, 0, 142); font-size: 16.2px;\">DISCLAIMER OF WARRANTY:</h4><p style=\"padding: 0px; margin-bottom: 11.5px; border: 0px solid rgb(228, 228, 228); font-family: Muli; color: rgb(51, 51, 51); font-size: 18px;\"><br style=\"padding: 0px; margin: 0px; border: 0px solid rgb(228, 228, 228); clear: both;\">Girlfriend Social provides service on an \"as is\" basis and grants no warranties of any kind, expressed, implied, statutory, in any communication with Girlfriend Social or its representatives, or otherwise with respect to the service. Girlfriend Social specifically disclaims any implied warranties of merchantability, fitness for a particular purpose, or non-infringement. Girlfriend Social does not warrant that your use of Girlfriend Social service will be secure, uninterrupted, always available, or error-free, or will meet your requirements, or that any defects in the service will be corrected. Girlfriend Social disclaims liability for, and no warranty is made with respect to, connectivity and availability.</p><h4 style=\"padding: 10px 0px; margin-right: 0px; margin-bottom: 10px; margin-left: 0px; border-image: initial; border-style: solid; border-width: 0px 0px 1px; border-color: rgb(228, 228, 228); font-family: Asap; color: rgb(236, 0, 142); font-size: 16.2px;\">LIMITATION OF LIABILITY:</h4><p style=\"padding: 0px; margin-bottom: 11.5px; border: 0px solid rgb(228, 228, 228); font-family: Muli; color: rgb(51, 51, 51); font-size: 18px;\"><br style=\"padding: 0px; margin: 0px; border: 0px solid rgb(228, 228, 228); clear: both;\">In no event will Girlfriend Social be liable to you for any incidental, consequential, or indirect damages (including, but not limited to, damages for loss of data, loss of programs, cost of procurement of substitute services or service interruptions) arising out of the use of or inability to use Girlfriend Social, even if Girlfriend Social or its agents or representatives know or have been advised of the possibility of such damages, or to any person other than you. Notwithstanding anything to the contrary contained herein, Girlfriend Social\'s liability to you for any cause whatsoever, and regardless of the form of the action, will at all times be limited to the amount paid, if any, by you to Girlfriend Social for the service during the term of membership. Girlfriend Social does not screen the members registering for services offered by Girlfriend Social in any way. As a result Girlfriend Social will not be liable for any damages, direct, indirect, incidental and/or consequential, arising out of the use of this service, including, without limitation, to damages arising out of communicating and/or meeting with other members of this service, or introduced to you via this service. Such damages include, without limitation, physical damages, bodily injury and or emotional distress and discomfort. Girlfriend Social asks all prospective participants if they are female, but we do not verify this information. Therefore, Girlfriend Social is not liable for the integrity of statements made by members as to their identity, marital status and general background. It is incumbent and advised upon the user to verify any and all information relating to but not limited to this subject. It is advised to check references of any member.</p><h4 style=\"padding: 10px 0px; margin-right: 0px; margin-bottom: 10px; margin-left: 0px; border-image: initial; border-style: solid; border-width: 0px 0px 1px; border-color: rgb(228, 228, 228); font-family: Asap; color: rgb(236, 0, 142); font-size: 16.2px;\">Grounds for Removal, Sanction and/or Suspension.</h4><p style=\"padding: 0px; margin-bottom: 11.5px; border: 0px solid rgb(228, 228, 228); font-family: Muli; color: rgb(51, 51, 51); font-size: 18px;\"><br style=\"padding: 0px; margin: 0px; border: 0px solid rgb(228, 228, 228); clear: both;\">Notwithstanding any other provision of this Agreement, the following types of actions are cause for immediate removal, repeal and/or suspension or termination of your account:</p><ol style=\"padding: 0px; margin-right: 0px; margin-bottom: 0px; margin-left: 0px; border: 0px solid rgb(228, 228, 228); font-family: Muli; color: rgb(51, 51, 51); font-size: 18px;\"><li style=\"padding: 0px; margin-top: 0px; margin-bottom: 0px; border: 0px solid rgb(228, 228, 228);\">The use of our website to (including, without limitation, eligibility requirements):<br style=\"padding: 0px; margin: 0px; border: 0px solid rgb(228, 228, 228); clear: both;\"><br style=\"padding: 0px; margin: 0px; border: 0px solid rgb(228, 228, 228); clear: both;\">(i) harm or intimidate another person in any way, including restricting or inhibiting any other user from using our Platform;<br style=\"padding: 0px; margin: 0px; border: 0px solid rgb(228, 228, 228); clear: both;\">(ii) impersonate any person or entity (including GFS, GFS staff and other members), or falsely state or otherwise misrepresent your affiliation with any person, through the use of similar email addresses, nicknames, or creation of false account(s) or any other method or device;<br style=\"padding: 0px; margin: 0px; border: 0px solid rgb(228, 228, 228); clear: both;\">(iii) disguise the origin of any Public Information that is transmitted to any third party;<br style=\"padding: 0px; margin: 0px; border: 0px solid rgb(228, 228, 228); clear: both;\">(iv) \"stalk\" or otherwise harass another;<br style=\"padding: 0px; margin: 0px; border: 0px solid rgb(228, 228, 228); clear: both;\">(v) advertise merchandise, auctions, services or commercial websites, commercial or personal events not approved by GFS, including charitable solicitations<br style=\"padding: 0px; margin: 0px; border: 0px solid rgb(228, 228, 228); clear: both;\">(vi) resell Public Information or access to Public Information;or<br style=\"padding: 0px; margin: 0px; border: 0px solid rgb(228, 228, 228); clear: both;\">(vii) collect or store personal data about other users;<br style=\"padding: 0px; margin: 0px; border: 0px solid rgb(228, 228, 228); clear: both;\"></li><li style=\"padding: 0px; margin-top: 0px; margin-bottom: 0px; border: 0px solid rgb(228, 228, 228);\">Posting any Public Information or other material:</li><br style=\"padding: 0px; margin: 0px; border: 0px solid rgb(228, 228, 228); clear: both;\">(i) that is unlawful, harmful, threatening, abusive, harassing, tortious, defamatory, intimidating, vulgar, obscene, profane, libelous, invasive of another\'s privacy (including the posting of private emails or contact information about another individual), hateful, or racially, ethically or otherwise objectionable, including any Public Information or other material that may be considered hate speech;<br style=\"padding: 0px; margin: 0px; border: 0px solid rgb(228, 228, 228); clear: both;\">(ii) that is obscene, pornographic or adult in nature;<br style=\"padding: 0px; margin: 0px; border: 0px solid rgb(228, 228, 228); clear: both;\">(iii) that you do not have a right to make available under any law or under contractual or fiduciary relationships;<br style=\"padding: 0px; margin: 0px; border: 0px solid rgb(228, 228, 228); clear: both;\">(iv) that infringes any patent, trademark, trade secret, copyright or other proprietary rights of any party or rights of publicity or privacy;<br style=\"padding: 0px; margin: 0px; border: 0px solid rgb(228, 228, 228); clear: both;\">(v) that is unsolicited or unauthorized advertising, promotional materials, or any other form of solicitation (including, but not limited to, \"spam,\" \"junk mail,\" and \"chain letters\");<br style=\"padding: 0px; margin: 0px; border: 0px solid rgb(228, 228, 228); clear: both;\">(vi) that is inappropriate, posted in bad faith, or contrary to the spirit of Girlfriend Social; or<br style=\"padding: 0px; margin: 0px; border: 0px solid rgb(228, 228, 228); clear: both;\">(vii) that uses Girlfriend Social Website primarily as a lead generator or listing service for another website;<br style=\"padding: 0px; margin: 0px; border: 0px solid rgb(228, 228, 228); clear: both;\"><br style=\"padding: 0px; margin: 0px; border: 0px solid rgb(228, 228, 228); clear: both;\"><li style=\"padding: 0px; margin-top: 0px; margin-bottom: 0px; border: 0px solid rgb(228, 228, 228);\">Encouraging others to violate this Agreement;</li><br style=\"padding: 0px; margin: 0px; border: 0px solid rgb(228, 228, 228); clear: both;\"><li style=\"padding: 0px; margin-top: 0px; margin-bottom: 0px; border: 0px solid rgb(228, 228, 228);\">Refusing to follow Girlfriend Social staff instruction or direction;</li><br style=\"padding: 0px; margin: 0px; border: 0px solid rgb(228, 228, 228); clear: both;\"><li style=\"padding: 0px; margin-top: 0px; margin-bottom: 0px; border: 0px solid rgb(228, 228, 228);\">Violation (intentional or unintentional) of this Agreement, or of any applicable local, provincial, national or international law, statute, ordinance or regulation;</li><li style=\"padding: 0px; margin-top: 0px; margin-bottom: 0px; border: 0px solid rgb(228, 228, 228);\">Disclose the Private Information of any member of Girlfriend Social without the permission of that member; or</li><br style=\"padding: 0px; margin: 0px; border: 0px solid rgb(228, 228, 228); clear: both;\"><li style=\"padding: 0px; margin-top: 0px; margin-bottom: 0px; border: 0px solid rgb(228, 228, 228);\">Transmit money to Girlfriend Social through financial accounts that are stolen, fraudulent or otherwise unauthorized.</li></ol><h4 style=\"padding: 10px 0px; margin-right: 0px; margin-bottom: 10px; margin-left: 0px; border-image: initial; border-style: solid; border-width: 0px 0px 1px; border-color: rgb(228, 228, 228); font-family: Asap; color: rgb(236, 0, 142); font-size: 16.2px;\">Content on GFS</h4><p style=\"padding: 0px; margin-bottom: 11.5px; border: 0px solid rgb(228, 228, 228); font-family: Muli; color: rgb(51, 51, 51); font-size: 18px;\">Also, your posting of other inappropriate actions, Public Information or other materials may also warrant removal and/or suspension from our website. Girlfriend Social reserves the right to remove any post or other material without warning or further notice.<br style=\"padding: 0px; margin: 0px; border: 0px solid rgb(228, 228, 228); clear: both;\"><br style=\"padding: 0px; margin: 0px; border: 0px solid rgb(228, 228, 228); clear: both;\">While we prohibit such conduct and content, you understand and agree that you nonetheless may be exposed to such conduct or content and that you use the website and attend Girlfriend Social Get Together\'s at your own risk.<br style=\"padding: 0px; margin: 0px; border: 0px solid rgb(228, 228, 228); clear: both;\"><br style=\"padding: 0px; margin: 0px; border: 0px solid rgb(228, 228, 228); clear: both;\">For purposes of this Agreement, \"posting\" includes uploading, posting, emailing, transmitting or otherwise making available. Without limiting the foregoing, Girlfriend Social and its designees shall have the right to remove any Public Information or other material that violates this Agreement or is otherwise objectionable.</p><p style=\"padding: 0px; margin-bottom: 11.5px; border: 0px solid rgb(228, 228, 228); font-family: Muli; color: rgb(51, 51, 51); font-size: 18px;\"></p><h4 style=\"padding: 10px 0px; margin-right: 0px; margin-bottom: 10px; margin-left: 0px; border-image: initial; border-style: solid; border-width: 0px 0px 1px; border-color: rgb(228, 228, 228); font-family: Asap; color: rgb(236, 0, 142); font-size: 16.2px;\">Abuse</h4><p><span style=\"color: rgb(51, 51, 51); font-family: Muli; font-size: 18px;\">Abuse is taken seriously by Girlfriend Social. Any user can report any message, profile or other items they feel are inappropriate. When a user reports abuse, because of the nature of the website, human moderation of accounts and messages is sometimes required. Accounts found to be violating the policy of this website will be removed accordingly.</span></p><h4 style=\"padding: 10px 0px; margin-right: 0px; margin-bottom: 10px; margin-left: 0px; border-image: initial; border-style: solid; border-width: 0px 0px 1px; border-color: rgb(228, 228, 228); font-family: Asap; color: rgb(236, 0, 142); font-size: 16.2px;\">User Content Posted on the Site</h4><p style=\"padding: 0px; margin-bottom: 11.5px; border: 0px solid rgb(228, 228, 228); font-family: Muli; color: rgb(51, 51, 51); font-size: 18px;\"><br style=\"padding: 0px; margin: 0px; border: 0px solid rgb(228, 228, 228); clear: both;\">You are solely responsible for the photos, profiles (including your name, image, and likeness), messages, notes, text, information, music, video, advertisements, listings, and other content that you upload, publish or display (hereinafter, \"post\") on or through the Service or the Site, or transmit to or share with other users (collectively the \"User Content\"). You may not post, transmit, or share User Content on the Site or Service that you did not create or that you do not have permission to post. You understand and agree that Girlfriend Social may, but is not obligated to, review the Site and may delete or remove (without notice) any Site Content or User Content in its sole discretion, for any reason or no reason, including User Content that in the sole judgment of Girlfriend Social violates this Agreement or Girlfriend Social Code of Conduct, or which might be offensive, illegal, or that might violate the rights, harm, or threaten the safety of users or others. You are solely responsible at your sole cost and expense for creating backup copies and replacing any User Content you post or store on the Site or provide to Girlfriend Social.</p><h4 style=\"padding: 10px 0px; margin-right: 0px; margin-bottom: 10px; margin-left: 0px; border-image: initial; border-style: solid; border-width: 0px 0px 1px; border-color: rgb(228, 228, 228); font-family: Asap; color: rgb(236, 0, 142); font-size: 16.2px;\">User Submitted Content</h4><p style=\"padding: 0px; margin-bottom: 11.5px; border: 0px solid rgb(228, 228, 228); font-family: Muli; color: rgb(51, 51, 51); font-size: 18px;\"><br style=\"padding: 0px; margin: 0px; border: 0px solid rgb(228, 228, 228); clear: both;\">When you post User Content to the Site, you authorize and direct us to make such copies thereof as we deem necessary in order to facilitate the posting and storage of the User Content on the Site. By posting User Content to any part of the Site, you automatically grant, and you represent and warrant that you have the right to grant, to Girlfriend Social an irrevocable, perpetual, non-exclusive, transferable, fully paid, worldwide license (with the right to sublicense) to use, copy, publicly perform, publicly display, reformat, translate, excerpt (in whole or in part) and distribute such User Content for any purpose, commercial, advertising, or otherwise, on or in connection with the Site or the promotion thereof, to prepare derivative works of, or incorporate into other works, such User Content, and to grant and authorize sublicenses of the foregoing. You may remove your User Content from the Site at any time. If you choose to remove your User Content, the license granted above will automatically expire, however you acknowledge that Girlfriend Social may retain archived copies of your User Content. Girlfriend Social does not assert any ownership over your User Content; rather, as between us and you, subject to the rights granted to us in these Terms, you retain full ownership of all of your User Content and any intellectual property rights or other proprietary rights associated with your User Content.</p><p style=\"padding: 0px; margin-bottom: 11.5px; border: 0px solid rgb(228, 228, 228); font-family: Muli; color: rgb(51, 51, 51); font-size: 18px;\"></p><h4 style=\"padding: 10px 0px; margin-right: 0px; margin-bottom: 10px; margin-left: 0px; border-image: initial; border-style: solid; border-width: 0px 0px 1px; border-color: rgb(228, 228, 228); font-family: Asap; color: rgb(236, 0, 142); font-size: 16.2px;\">Copyright Complaints</h4><p style=\"padding: 0px; margin-bottom: 11.5px; border: 0px solid rgb(228, 228, 228); font-family: Muli; color: rgb(51, 51, 51); font-size: 18px;\"><br style=\"padding: 0px; margin: 0px; border: 0px solid rgb(228, 228, 228); clear: both;\">We respect the intellectual property rights of others and we prohibit users from uploading, posting or otherwise transmitting on Girlfriend Social website or service any materials that violate another party\'s intellectual property rights. When we receive proper Notification of Alleged Copyright Infringement as described in our Girlfriend Social Copyright Policy, we promptly remove or disable access to the allegedly infringing material and terminate the accounts of repeate infringers as described herein in accordance with the Digital Millenium Copyright Act. If you believe that any material on the Site infringes upon any copyright which you own or control, you may send a written notification of such infringement to our Designated Agent. Please see our Girlfriend Social Copyright Policy for more information on how to report infringement of your copyright.</p><h4 style=\"padding: 10px 0px; margin-right: 0px; margin-bottom: 10px; margin-left: 0px; border-image: initial; border-style: solid; border-width: 0px 0px 1px; border-color: rgb(228, 228, 228); font-family: Asap; color: rgb(236, 0, 142); font-size: 16.2px;\">Repeat Infringer Policy</h4><p style=\"padding: 0px; margin-bottom: 11.5px; border: 0px solid rgb(228, 228, 228); font-family: Muli; color: rgb(51, 51, 51); font-size: 18px;\"><br style=\"padding: 0px; margin: 0px; border: 0px solid rgb(228, 228, 228); clear: both;\">In accordance with the Digital Millennium Copyright Act (DMCA) and other applicable law, Girlfriend Social has adopted a policy of terminating, in appropriate circumstances and at Girlfriend Social\'s sole discretion, members who are deemed to be repeat infringers. Girlfriend Social may also at its sole discretion limit access to the Site and/or terminate the memberships of any users who infringe any intellectual property rights of others, whether or not there is any repeat infringement.</p><h4 style=\"padding: 10px 0px; margin-right: 0px; margin-bottom: 10px; margin-left: 0px; border-image: initial; border-style: solid; border-width: 0px 0px 1px; border-color: rgb(228, 228, 228); font-family: Asap; color: rgb(236, 0, 142); font-size: 16.2px;\">Third Party Websites and Content</h4><p style=\"padding: 0px; margin-bottom: 11.5px; border: 0px solid rgb(228, 228, 228); font-family: Muli; color: rgb(51, 51, 51); font-size: 18px;\"><br style=\"padding: 0px; margin: 0px; border: 0px solid rgb(228, 228, 228); clear: both;\">The Site contains (or you may be sent through the Site or the Service) links to other web sites (\"Third Party Sites\") as well as articles, photographs, text, graphics, pictures, designs, music, sound, video, information, applications, software and other content or items belonging to or originating from third parties (the \"Third Party Applications, Software or Content\"). Such Third Party Sites and Third Party Applications, Software or Content are not investigated, monitored or checked for accuracy, appropriateness, or completeness by us, and we are not responsible for any Third Party Sites accessed through the Site or any Third Party Applications, Software or Content posted on, available through or installed from the Site, including the content, accuracy, offensiveness, opinions, reliability, privacy practices or other policies of or contained in the Third Party Sites or the Third Party Applications, Software or Content. Inclusion of, linking to or permitting the use or installation of any Third Party Site or any Third Party Applications, Software or Content does not imply approval or endorsement thereof by us. If you decide to leave the Site and access the Third Party Sites or to use or install any Third Party Applications, Software or Content, you do so at your own risk and you should be aware that our terms and policies no longer govern. You should review the applicable terms and policies, including privacy and data gathering practices, of any site to which you navigate from the Site or relating to any applications you use or install from the site.</p><h4 style=\"padding: 10px 0px; margin-right: 0px; margin-bottom: 10px; margin-left: 0px; border-image: initial; border-style: solid; border-width: 0px 0px 1px; border-color: rgb(228, 228, 228); font-family: Asap; color: rgb(236, 0, 142); font-size: 16.2px;\">Waiver for Events</h4><p><a name=\"waiver\" style=\"padding: 0px; margin: 0px; border: 0px solid rgb(228, 228, 228); font-family: Muli; font-weight: 400; color: rgb(51, 51, 51); font-size: 18px; text-decoration-thickness: initial; text-decoration-style: initial; text-decoration-color: initial;\"></a></p><p style=\"padding: 0px; margin-bottom: 11.5px; border: 0px solid rgb(228, 228, 228); font-family: Muli; color: rgb(51, 51, 51); font-size: 18px;\">I do hereby absolve, release and waive any and all civil or criminal liability litigation claims or demands against Girlfriend Social, Fortunegeek Corporation, \"GFS\", its officers, volunteers, directors, leaders, consultants, employees which may arise out of or be related to any injury, damage or pecuniary loss to me or any member of my family by reason of involvement in any club or club related activities.<br style=\"padding: 0px; margin: 0px; border: 0px solid rgb(228, 228, 228); clear: both;\"><br style=\"padding: 0px; margin: 0px; border: 0px solid rgb(228, 228, 228); clear: both;\">Fortunegeek Corporation/Girlfriend Social reserves the right to refuse anyone entry into any event or can cancel an account without notice. The act of accepting this waiver makes the individual solely responsible for his/her safety while on the event, after the completion of the event and at all venues throughout any event. The act of accepting this waiver agrees that the individual, if intoxicated, will not operate a motorized vehicle after leaving any Girlfriend Social events or tours.</p>', '2022-08-07 23:23:26', '2022-08-07 23:35:50');
