(2, 'Terms and conditions', 'terms-and-conditions', NULL, '<h1 style=\"padding: 0px; margin-right: 0px; margin-bottom: 0px; margin-left: 0px; border: 0px solid rgb(228, 228, 228); font-family: Asap; font-size: 39.6px; color: rgb(51, 51, 51);\">TERMS &amp; CONDITIONS of GIRLFRIEND SOCIAL</h1><p style=\"padding: 0px; margin-bottom: 11.5px; border: 0px solid rgb(228, 228, 228); font-family: Muli; color: rgb(51, 51, 51); font-size: 18px;\">Girlfriend Social provides a way for women to meet and become friends with other women, while enjoying fun and newies. This is a legal agreement (\"Agreement\") between you and Girlfriend Social. Please read the Agreement carefully before registering. By registering, you become a member of Girlfriend Social and you agree to be bound by the terms and conditions of this Agreement (the \"Terms\") for as long as you continue to be a Member. If you do not agree to the terms, please do not register for Girlfriend Social. The terms are subject to change by Girlfriend Social at any time, effective upon notice to you.</p><p style=\"padding: 0px; margin-bottom: 11.5px; border: 0px solid rgb(228, 228, 228); font-family: Muli; color: rgb(51, 51, 51); font-size: 18px;\"><i style=\"padding: 0px; margin: 0px; border: 0px solid rgb(228, 228, 228);\">If you have been linked to this page for account abuse, pay close attention to the following area as it means you\'ve likely done some of the below. We will remove accounts who we find are doing any of the following:</i></p><h1 style=\"padding: 0px; margin-right: 0px; margin-bottom: 0px; margin-left: 0px; border: 0px solid rgb(228, 228, 228); font-family: Asap; font-size: 39.6px; color: rgb(51, 51, 51);\">General \"Don\'t Do These Things\" Girlfriend Social Rules</h1><ul style=\"padding: 0px; margin-right: 0px; margin-bottom: 0px; margin-left: 0px; border: 0px solid rgb(228, 228, 228); font-family: Muli; list-style-type: none; color: rgb(51, 51, 51); font-size: 18px;\"><li style=\"padding: 0px; margin: 0px; border: 0px solid rgb(228, 228, 228);\">* Insult, Abuse, Flame or attack other members in message or on your profile</li><li style=\"padding: 0px; margin: 0px; border: 0px solid rgb(228, 228, 228);\">* Post personally identifiable information (i.e. name, address, email, phone number, etc.) of another member</li><li style=\"padding: 0px; margin: 0px; border: 0px solid rgb(228, 228, 228);\">* Repeatedly reporting users you just don\'t like, instead of blocking them, ignoring them and moving on like an adult</li><li style=\"padding: 0px; margin: 0px; border: 0px solid rgb(228, 228, 228);\">* Mass bully group up and reporting a member you don\'t like. 1 Issue, 1 Report</li><li style=\"padding: 0px; margin: 0px; border: 0px solid rgb(228, 228, 228);\">* Openly arguing with a moderator or GFS staff</li><li style=\"padding: 0px; margin: 0px; border: 0px solid rgb(228, 228, 228);\">* Mass Spamming users</li><li style=\"padding: 0px; margin: 0px; border: 0px solid rgb(228, 228, 228);\">* Threats of violence or harassment, even as a joke</li><li style=\"padding: 0px; margin: 0px; border: 0px solid rgb(228, 228, 228);\">* Racism, discrimination, hate speech</li><li style=\"padding: 0px; margin: 0px; border: 0px solid rgb(228, 228, 228);\">* Abusive language, including excessive swearing</li><li style=\"padding: 0px; margin: 0px; border: 0px solid rgb(228, 228, 228);\">* Religious, political, and other “prone to huge arguments” threads that you keep pushing</li><li style=\"padding: 0px; margin: 0px; border: 0px solid rgb(228, 228, 228);\">* Asking users for money on the site</li><li style=\"padding: 0px; margin: 0px; border: 0px solid rgb(228, 228, 228);\">* Post links to phishing sites</li><li style=\"padding: 0px; margin: 0px; border: 0px solid rgb(228, 228, 228);\">* Re-post Closed, Modified, Deleted Content Or Recreating Banned Accounts</li><li style=\"padding: 0px; margin: 0px; border: 0px solid rgb(228, 228, 228);\">* Recruiting members to competing websites - Meetup, WhatsApp, Other Websites/Friendship sites, Etc.</li><li style=\"padding: 0px; margin: 0px; border: 0px solid rgb(228, 228, 228);\">* Porn, inappropriate or offensive content, or anything else not safe for work</li><li style=\"padding: 0px; margin: 0px; border: 0px solid rgb(228, 228, 228);\">* Selling, Soliciting, begging, affiliate, auctioning, raffling, advertising, referrals of any kind</li></ul><p><br style=\"padding: 0px; margin: 0px; border: 0px solid rgb(228, 228, 228); font-family: Muli; clear: both; color: rgb(51, 51, 51); font-size: 18px;\"><span style=\"color: rgb(51, 51, 51); font-family: Muli; font-size: 18px;\">Basically&nbsp;</span><span style=\"padding: 0px; margin: 0px; border: 0px solid rgb(228, 228, 228); font-family: Muli; font-weight: 700; color: rgb(51, 51, 51); font-size: 18px;\">we are all adults here</span><span style=\"color: rgb(51, 51, 51); font-family: Muli; font-size: 18px;\">. You may not get along with everyone, but we are a free to use friendship website, Not a baby sitting service to figure out your personal \"I don\'t like her\" disputes. Use the block button and learn to ignore other members who you don\'t like. Constantly engaging and continuing arguments with GFS members you do not like is not productive for anyone when you could just as easily ignore the members you just don\'t get along with. Be the bigger person. We investigate all abuse reports seriously and will remove anyone as we see fit. The rest of this document contains additional reasons for removal and more legal terms. By using GFS you agree to all terms of this document.</span></p><p style=\"padding: 0px; margin-bottom: 11.5px; border: 0px solid rgb(228, 228, 228); font-family: Muli; color: rgb(51, 51, 51); font-size: 18px;\"></p><p><br style=\"padding: 0px; margin: 0px; border: 0px solid rgb(228, 228, 228); font-family: Muli; clear: both; color: rgb(51, 51, 51); font-size: 18px;\"></p><h4 style=\"padding: 10px 0px; margin-right: 0px; margin-bottom: 10px; margin-le