8);\">Posting any Public Information or other material:</li><br style=\"padding: 0px; margin: 0px; border: 0px solid rgb(228, 228, 228); clear: both;\">(i) that is unlawful, harmful, threatening, abusive, harassing, tortious, defamatory, intimidating, vulgar, obscene, profane, libelous, invasive of another\'s privacy (including the posting of private emails or contact information about another individual), hateful, or racially, ethically or otherwise objectionable, including any Public Information or other material that may be considered hate speech;<br style=\"padding: 0px; margin: 0px; border: 0px solid rgb(228, 228, 228); clear: both;\">(ii) that is obscene, pornographic or adult in nature;<br style=\"padding: 0px; margin: 0px; border: 0px solid rgb(228, 228, 228); clear: both;\">(iii) that you do not have a right to make available under any law or under contractual or fiduciary relationships;<br style=\"padding: 0px; margin: 0px; border: 0px solid rgb(228, 228, 228); clear: both;\">(iv) that infringes any patent, trademark, trade secret, copyright or other proprietary rights of any party or rights of publicity or privacy;<br style=\"padding: 0px; margin: 0px; border: 0px solid rgb(228, 228, 228); clear: both;\">(v) that is unsolicited or unauthorized advertising, promotional materials, or any other form of solicitation (including, but not limited to, \"spam,\" \"junk mail,\" and \"chain letters\");<br style=\"padding: 0px; margin: 0px; border: 0px solid rgb(228, 228, 228); clear: both;\">(vi) that is inappropriate, posted in bad faith, or contrary to the spirit of Girlfriend Social; or<br style=\"padding: 0px; margin: 0px; border: 0px solid rgb(228, 228, 228); clear: both;\">(vii) that uses Girlfriend Social Website primarily as a lead generator or listing service for another website;<br style=\"padding: 0px; margin: 0px; border: 0px solid rgb(228, 228, 228); clear: both;\"><br style=\"padding: 0px; margin: 0px; border: 0px solid rgb(228, 228, 228); clear: both;\"><li style=\"padding: 0px; margin-top: 0px; margin-bottom: 0px; border: 0px solid rgb(228, 228, 228);\">Encouraging others to violate this Agreement;</li><br style=\"padding: 0px; margin: 0px; border: 0px solid rgb(228, 228, 228); clear: both;\"><li style=\"padding: 0px; margin-top: 0px; margin-bottom: 0px; border: 0px solid rgb(228, 228, 228);\">Refusing to follow Girlfriend Social staff instruction or direction;</li><br style=\"padding: 0px; margin: 0px; border: 0px solid rgb(228, 228, 228); clear: both;\"><li style=\"padding: 0px; margin-top: 0px; margin-bottom: 0px; border: 0px solid rgb(228, 228, 228);\">Violation (intentional or unintentional) of this Agreement, or of any applicable local, provincial, national or international law, statute, ordinance or regulation;</li><li style=\"padding: 0px; margin-top: 0px; margin-bottom: 0px; border: 0px solid rgb(228, 228, 228);\">Disclose the Private Information of any member of Girlfriend Social without the permission of that member; or</li><br style=\"padding: 0px; margin: 0px; border: 0px solid rgb(228, 228, 228); clear: both;\"><li style=\"padding: 0px; margin-top: 0px; margin-bottom: 0px; border: 0px solid rgb(228, 228, 228);\">Transmit money to Girlfriend Social through financial accounts that are stolen, fraudulent or otherwise unauthorized.</li></ol><h4 style=\"padding: 10px 0px; margin-right: 0px; margin-bottom: 10px; margin-left: 0px; border-image: initial; border-style: solid; border-width: 0px 0px 1px; border-color: rgb(228, 228, 228); font-family: Asap; color: rgb(236, 0, 142); font-size: 16.2px;\">Content on GFS</h4><p style=\"padding: 0px; margin-bottom: 11.5px; border: 0px solid rgb(228, 228, 228); font-family: Muli; color: rgb(51, 51, 51); font-size: 18px;\">Also, your posting of other inappropriate actions, Public Information or other materials may also warrant removal and/or suspension from our website. Girlfriend Social reserves the right to remove any post or other material without warning or further notice.<br style=\"padding: 0px; margin: 0px; border: 0px solid rgb(228, 228, 228); clear: both;\"><br style=\"padding: 0px; margin: 0px; border: 0px solid rgb(228, 228, 228); clear: both;\">While we prohibit such conduct and content, you understand and agree that you nonetheless may be exposed to such conduct or content and that you use the website and attend Girlfriend Social Get Together\'s at your own risk.<br style=\"padding: 0px; margin: 0px; border: 0px solid rgb(228, 228, 228); clear: both;\"><br style=\"padding: 0px; margin: 0px; border: 0px solid rgb(228, 228, 228); clear: both;\">For purposes of this Agreement, \"posting\" includes uploading, posting, emailing, transmitting or otherwise making available. Without limiting the foregoing, Girlfriend Social and its designees shall have the right to remove any Public Information or other material that violates this Agreement or is otherwise objectionable.</p><p style=\"padding: 0px; margin-bottom: 11.5px; border: 0px solid rgb(228, 228, 228); font-family: Muli; color: rgb(51, 51, 51); font-size: 18px;\"></p><h4 style=\"padding: 10px 0px; margin-right: 0px; margin-bottom: 10px; margin-left: 0px; border-image: initial; border-style: solid; border-width: 0px 0px 1px; border-color: rgb(228, 228, 228); font-family: Asap; color: rgb(236, 0, 142); font-size: 16.2px;\">Abuse</h4><p><span style=\"color: rgb(51, 51, 51); font-family: Muli; font-size: 18px;\">Abuse is taken seriously by Girlfriend Social. Any user can report any message, profile or other items they feel are inappropriate. When a user reports abuse, because of the nature of the website, human moderation of accounts and messages is sometimes required. Accounts found to be violating the policy of this website will be removed accordingly.</span></p><h4 style=\"padding: 10px 0px; margin-right: 0px; margin-bottom: 10px; margin-left: 0px; border-image: initial; border-style: solid; border-width: 0px 0px 1px; border-color: rgb(228, 228, 228); font-family: Asap; color: rgb(236, 0, 142); font-size: 16.2px;\">User Content Posted on the Site</h4><p style=\"padding: 0px; margin-bottom: 11.5px; border: 0px solid rgb(228, 228, 228); font-family: Muli; color: rgb(51, 51, 51); font-size: 18px;\"><br style=\"padding: 0px; margin: 0px; border: 0px solid rgb(228, 228, 228); clear: both;\">You are solely responsible for the photos, profiles (including your name, image, and likeness), messages, notes, text, information, music, video, advertisements, listings, and other content that you upload, publish or display (hereinafter, \"post\") on or through the Service or the Site, or transmit to or share with other users (collectively the \"User Content\"). You may not post, transmit, or share User Content on the Site or Service that you did not create or that you do not have permission to post. You understand and agree that Girlfriend Social may, but is not obligated to, review the Site and may delete or remove (without notice) any Site Content or User Content in its sole discretion, for any reason or no reason, including User Content that in the sole judgment of Girlfriend Social violates this Agreement or Girlfriend Social Code of Conduct, or which might be offensive, illegal, or that might violate the rights, harm, or threaten the safety of users or others. You are solely responsible at your sole cost and expense for creating backup copies and replacing any User Content you post or store on the Site or provide to Girlfriend Social.</p><h4 style=\"padding: 10px 0px; margin-right: 0px; margin-bottom: 10px; margin-left: 0px; border-image: initial; border-style: solid; border-width: 0px 0px 1px; border-color: rgb(228, 228, 228); font-family: Asap; color: rgb(236, 0, 142); font-size: 16.2px;\">User Submitted Content</h4><p style=\"padding: 0px; margin-bottom: 11.5px; border: 0px solid rgb(228, 228, 228); font-family: Muli; color: rgb(51, 51, 51); font-size: 18px;\"><br style=\"padding: 0px; margin: 0px; border: 0px solid rgb(228, 228, 228); clear: both;\">When you post User Content to the Site, you authorize and direct us to make such copies thereof as we deem necessary in order to facilitate the posting and storage of the User Content on the Site. By posting User Content to any part of the Site, you automatically grant, and you represent and warrant that you have the right to grant, to Girlfriend Social an irrevocable, perpetual, non-exclusive, transferable, fully paid, worldwide license (with the right to sublicense) to use, copy, publicly perform, publicly display, reformat, translate, excerpt (in whole or in part) and distribute such User Content for any purpose, commercial, advertising, or otherwise, on or in connection with the Site or the promotion thereof, to prepare derivative works of, or incorporate into other works, such User Content, and to grant and authorize sublicenses of the foregoing. You may remove your User Content from the Site at any time. If you choose to remove your User Content, the license granted above will automatically expire, however you acknowledge that Girlfriend Social may retain archived copies of your User Content. Girlfriend Social does not assert any ownership over your User Content; rather, as between us and you, subject to the rights granted to us in these Terms, you retain full ownership of all of your User Content and any intellectual property rights or other proprietary rights associated with your User Content.</p><p style=\"padding: 0px; margin-bottom: 11.5px; border: 0px solid rgb(228, 228, 228); font-family: Muli; color: rgb(51, 51, 51); font-size: 18px;\"></p><h4 style=\"padding: 10px 0px; margin-right: 0px; margin-bottom: 10px; margin-left: 0px; border-image: initial; border-style: solid; border-width: 0px 0px 1px; border-color: rgb(228, 228, 228); font-family: Asap; color: rgb(236, 0, 142); font-size: 16.2px;\">Copyright Complaints</h4><p style=\"padding: 0px; margin-bottom: 11.5px; border: 0px solid rgb(228, 228, 228); font-family: Muli; color: rgb(51, 51, 51); font-size: 18px;\"><br style=\"padding: 0px; margin: 0px; border: 0px solid rgb(228, 228, 228); clear: both;\">We respect the intellectual property rights of others and we prohibit users from uploading, posting or otherwise transmitting on Girlfriend Social website or service any materials that violate another party\'s intellectual property rights. When we receive proper Notification of Alleged Copyright Infringement as described in our Girlfriend Social Copyright Policy, we promptly remove or disable access to the allegedly infringing material and terminate the accounts of repeate infringers as described herein in accordance with the Digital Millenium Copyright Act. If you believe that any material on the Site infringes upon any copyright which you own or control, you may send a written notification of such infringement to our Designated Agent. Please see our Girlfriend Social Copyright Policy for more information on how to report infringement of your copyright.</p><h4 style=\"padding: 10px 0px; margin-right: 0px; margin-bottom: 10px; margin-left: 0px; border-image: initial; border-style: solid; border-width: 0px 0px 1px; border-color: rgb(228, 228, 228); font-family: Asap; color: rgb(236, 0, 142); font-size: 16.2px;\">Repeat Infringer Policy</h4><p style=\"padding: 0px; margin-bottom: 11.5px; border: 0px solid rgb(228, 228, 228); font-family: Muli; color: rgb(51, 51, 51); font-size: 18px;\"><br style=\"padding: 0px; margin: 0px; border: 0px solid rgb(228, 228, 228); clear: both;\">In accordance with the Digital Millennium Copyright Act (DMCA) and other applicable law, Girlfriend Social has adopted a policy of terminating, in appropriate circumstances and at Girlfriend Social\'s sole discretion, members who are deemed to be repeat infringers. Girlfriend Social may also at its sole discretion limit access to the Site and/or terminate the memberships of any users who infringe any intellectual property rights of others, whether or not there is any repeat infringement.</p><h4 style=\"padding: 10px 0px; margin-right: 0px; margin-bottom: 10px; margin-left: 0px; border-image: initial; border-style: solid; border-width: 0px 0px 1px; border-color: rgb(228, 228, 228); font-family: Asap; color: rgb(236, 0, 142); font-size: 16.2px;\">Third Party Websites and Content</h4><p style=\"padding: 0px; margin-bottom: 11.5px; border: 0px solid rgb(228, 228, 228); font-family: Muli; color: rgb(51, 51, 51); font-size: 18px;\"><br style=\"padding: 0px; margin: 0px; border: 0px solid rgb(228, 228, 228); clear: both;\">The Site contains (or you may be sent through the Site or the Service) links to other web sites (\"Third Party Sites\") as well as articles, photographs, text, graphics, pictures, designs, music, sound, video, information, applications, software and other content or items belonging to or originating from third parties (the \"Third Party Applications, Software or Content\"). Such Third Party Sites and Third Party Applications, Software or Content are not investigated, monitored or checked for accuracy, appropriateness, or completeness by us, and we are not responsible for any Third Party Sites accessed through the Site or any Third Party Applications, Software or Content posted on, available through or installed from the Site, including the content, accuracy, offensiveness, opinions, reliability, privacy practices or other policies of or contained in the Third Party Sites or the Third Party Applications, Software or Content. Inclusion of, linking to or permitting the use or installation of any Third Party Site or any Third Party Applications, Software or Content does not imply approval or endorsement thereof by us. If you decide to leave the Site and access the Third Party Sites or to use or install any Third Party Applications, Software or Content, you do so at your own risk and you should be aware that our terms and policies no longer govern. You should review the applicable terms and policies, including privacy and data gathering practices, of any site to which you navigate from the Site or relating to any applications you use or install from the site.</p><h4 style=\"padding: 10px 0px; margin-right: 0px; margin-bottom: 10px; margin-left: 0px; border-image: initial; border-style: solid; border-width: 0px 0px 1px; border-color: rgb(228, 228, 228); font-family: Asap; color: rgb(236, 0, 142); font-size: 16.2px;\">Waiver for Events</h4><p><a name=\"waiver\" style=\"padding: 0px; margin: 0px; border: 0px solid rgb(228, 228, 228); font-family: Muli; font-weight: 400; color: rgb(51, 51, 51); font-size: 18px; text-decoration-thickness: initial; text-decoration-style: initial; text-decoration-color: initial;\"></a></p><p style=\"padding: 0px; margin-bottom: 11.5px; border: 0px solid rgb(228, 228, 228); font-family: Muli; color: rgb(51, 51, 51); font-size: 18px;\">I do hereby absolve, release and waive any and all civil or criminal liability litigation claims or demands against Girlfriend Social, Fortunegeek Corporation, \"GFS\", its officers, volunteers, directors, leaders, consultants, employees which may arise out of or be related to any injury, damage or pecuniary loss to me or any member of my family by reason of involvement in any club or club related activities.<br style=\"padding: 0px; margin: 0px; border: 0px solid rgb(228, 228, 228); clear: both;\"><br style=\"padding: 0px; margin: 0px; border: 0px solid rgb(228, 228, 228); clear: both;\">Fortunegeek Corporation/Girlfriend Social reserves the right to refuse anyone entry into any event or can cancel an account without notice. The act of accepting this waiver makes the individual solely responsible for his/her safety while on the event, after the completion of the event and at all venues throughout any event. The act of accepting this waiver agrees that the individual, if intoxicated, will not operate a motorized vehicle after leaving any Girlfriend Social events or tours</p>', '2022-08-07 23:39:21', '2022-08-08 05:08:28'),
(3, 'Safety', 'safety', '1659953867dashboard.jpg', '<ol><li style=\"padding: 0px; margin-right: 0px; margin-bottom: 0px; margin-left: 0px; border: 0px solid rgb(228, 228, 228); font-family: Asap; font-size: 39.6px; color: rgb(51, 51, 51);\"><span style=\"padding: 0px; margin: 0px; border: 0px solid rgb(228, 228, 228); font-family: Muli; color: rgb(51, 51, 51); font-size: 18px;\">Remember you don\'t know who you are talking to...</span></li><li style=\"padding: 0px; margin-right: 0px; margin-bottom: 0px; margin-left: 0px; border: 0px solid rgb(228, 228, 228); font-family: Asap; font-size: 39.6px; color: rgb(51, 51, 51);\"><span style=\"color: rgb(51, 51, 51); font-family: Muli; font-size: 18px; font-weight: 400;\">Don\'t hand out your phone number, social media, address or other personal details till your comfortable. Use GFS free messaging features first!</span></li><li style=\"padding: 0px; margin-right: 0px; margin-bottom: 0px; margin-left: 0px; border: 0px solid rgb(228, 228, 228); font-family: Asap; font-size: 39.6px; color: rgb(51, 51, 51);\"><span style=\"color: rgb(51, 51, 51); font-family: Muli; font-size: 18px; font-weight: 400;\">Only meet in public locations or try and arrange a group meet up.</span></li><li style=\"padding: 0px; margin-right: 0px; margin-bottom: 0px; margin-left: 0px; border: 0px solid rgb(228, 228, 228); font-family: Asap; font-size: 39.6px; color: rgb(51, 51, 51);\"><span style=\"color: rgb(51, 51, 51); font-family: Muli; font-size: 18px; font-weight: 400;\">Try talking on the phone first</span></li><li style=\"padding: 0px; margin-right: 0px; margin-bottom: 0px; margin-left: 0px; border: 0px solid rgb(228, 228, 228); font-family: Asap; font-size: 39.6px; color: rgb(51, 51, 51);\"><span style=\"color: rgb(51, 51, 51); font-family: Muli; font-size: 18px; font-weight: 400;\">If anyone asks you for any kind of loan, money or sexual themes - Report them immediately (they wont know)</span><br style=\"padding: 0px; margin: 0px; border: 0px solid rgb(228, 228, 228); font-family: Muli; font-weight: 400; clear: both; color: rgb(51, 51, 51); font-size: 18px;\"><br style=\"padding: 0px; margin: 0px; border: 0px solid rgb(228, 228, 228); font-family: Muli; font-weight: 400; clear: both; color: rgb(51, 51, 51); font-size: 18px;\"></li></ol><h1 style=\"padding: 0px; margin-right: 0px; margin-bottom: 0px; margin-left: 0px; border: 0px solid rgb(228, 228, 228); font-family: Asap; font-size: 39.6px; color: rgb(51, 51, 51);\">Report Anyone Suspicious</h1><h1 style=\"padding: 0px; margin-right: 0px; margin-bottom: 0px; margin-left: 0px; border: 0px solid rgb(228, 228, 228); font-family: Asap; font-size: 39.6px; color: rgb(51, 51, 51);\"><br style=\"padding: 0px; margin: 0px; border: 0px solid rgb(228, 228, 228); font-family: Muli; font-weight: 400; clear: both; color: rgb(51, 51, 51); font-size: 18px;\"><span style=\"color: rgb(51, 51, 51); font-family: Muli; font-size: 18px; font-weight: 400;\">You can report most things on the website that seem off or breaking the rules by looking for a button like this.</span><br style=\"padding: 0px; margin: 0px; border: 0px solid rgb(228, 228, 228); font-family: Muli; font-weight: 400; clear: both; color: rgb(51, 51, 51); font-size: 18px;\"><br style=\"padding: 0px; margin: 0px; border: 0px solid rgb(228, 228, 228); font-family: Muli; font-weight: 400; clear: both; color: rgb(51, 51, 51); font-size: 18px;\"><div class=\"profile_menu2\" style=\"padding: 0px; margin: 0px; border: 0px solid rgb(228, 228, 228); font-family: Muli; font-weight: 400; font-size: 18px; color: rgb(51, 51, 51);\"><img src=\"https://www.girlfriendsocial.com/images/icons/report.png\" style=\"padding: 0px; margin: 0px; border: 0px solid rgb(228, 228, 228);\"><br style=\"padding: 0px; margin: 0px; border: 0px solid rgb(228, 228, 228); clear: both;\"><br style=\"padding: 0px; margin: 0px; border: 0px solid rgb(228, 228, 228); clear: both;\"><span style=\"padding: 0px; margin: 0px; border: 0px solid rgb(228, 228, 228); font-weight: 700;\"><u style=\"padding: 0px; margin: 0px; border: 0px solid rgb(228, 228, 228);\"></u></span><center style=\"padding: 0px; margin: 0px; border: 0px solid rgb(228, 228, 228);\"><span style=\"padding: 0px; margin: 0px; border: 0px solid rgb(228, 228, 228); font-weight: 700;\"><u style=\"padding: 0px; margin: 0px; border: 0px solid rgb(228, 228, 228);\">ONLY THE SECURITY TEAM WILL BE NOTIFIED OF THE REPORT!</u></span><br style=\"padding: 0px; margin: 0px; border: 0px solid rgb(228, 228, 228); clear: both;\"><img src=\"https://www.girlfriendsocial.com/images/security.jpg\" border=\"0\" style=\"padding: 0px; margin: 0px; border: 0px solid rgb(228, 228, 228);\"><br style=\"padding: 0px; margin: 0px; border: 0px solid rgb(228, 228, 228); clear: both;\"><br style=\"padding: 0px; margin: 0px; border: 0px solid rgb(228, 228, 228); clear: both;\">The person you are reporting will never know. GFS security will investigate all reports!</center><br style=\"padding: 0px; margin: 0px; border: 0px solid rgb(228, 228, 228); clear: both;\"></div><center style=\"padding: 0px; margin: 0px; border: 0px solid rgb(228, 228, 228); font-family: Muli; font-weight: 400; color: rgb(51, 51, 51); font-size: 18px;\"><img src=\"https://www.girlfriendsocial.com/images/getout.gif\" border=\"0\" style=\"padding: 0px; margin: 0px; border: 0px solid rgb(228, 228, 228);\"></center></h1>', '2022-08-08 05:16:26', '2022-08-08 05:24:28');
INSERT INTO `settings` (`id`, `title`, `slug`, `image`, `value`, `created_at`, `updated_at`) VALUES
(4, 'About us', 'about-us', NULL, '<h1 style=\"padding: 0px; margin-right: 0px; margin-bottom: 0px; margin-left: 0px; border: 0px solid rgb(228, 228, 228); font-family: Asap; font-size: 39.6px; color: rgb(51, 51, 51);\">About Girlfriend Social</h1><h2 style=\"padding: 0px; margin-right: 0px; margin-bottom: 10px; margin-left: 0px; border: 0px solid rgb(228, 228, 228); font-family: Asap; color: rgb(236, 0, 142); font-size: 27px;\">What is Girlfriend Social?</h2><p><a href=\"https://www.girlfriendsocial.com/\" style=\"padding: 0px; margin: 0px; border: 0px solid rgb(228, 228, 228); font-family: Muli; font-weight: 400; color: rgb(80, 185, 180); text-decoration: none; user-select: none; font-size: 18px;\"><img src=\"https://www.girlfriendsocial.com/public/admin/GFSlogoMail.png\" width=\"320\" height=\"135\" style=\"padding: 0px; margin: 0px; border: 0px solid rgb(228, 228, 228);\"></a><br style=\"padding: 0px; margin: 0px; border: 0px solid rgb(228, 228, 228); font-family: Muli; clear: both; color: rgb(51, 51, 51); font-size: 18px;\"><span style=\"color: rgb(51, 51, 51); font-family: Muli; font-size: 18px;\">Girlfriend Social is the largest women-only worldwide friendship making website available. Established in Jan, 2009, GFS is growing at an amazing pace. Girlfriend Social is free for all women to sign up, create a profile and talk to other women. Girlfriend social allows women to share and bond in whatever ways they are comfortable.</span></p><p><span style=\"color: rgb(51, 51, 51); font-family: Muli; font-size: 18px;\"><br></span></p><p><span style=\"color: rgb(51, 51, 51); font-family: Muli; font-size: 18px;\"><br></span></p><p><span style=\"color: rgb(51, 51, 51); font-family: Muli; font-size: 18px;\"><br></span></p><p><span style=\"color: rgb(51, 51, 51); font-family: Muli; font-size: 18px;\">You can match with local friend ship groups and Private messaging is all inside to explore!</span><br style=\"padding: 0px; margin: 0px; border: 0px solid rgb(228, 228, 228); font-family: Muli; clear: both; color: rgb(51, 51, 51); font-size: 18px;\"><span style=\"color: rgb(51, 51, 51); font-family: Muli; font-size: 18px;\">We also manage a popular women themed blog and social media channels that includes women themed positive stories under the Girlfriend Social Brand.</span></p><p style=\"padding: 0px; margin-bottom: 11.5px; border: 0px solid rgb(228, 228, 228); font-family: Muli; color: rgb(51, 51, 51); font-size: 18px;\"></p><p><br style=\"padding: 0px; margin: 0px; border: 0px solid rgb(228, 228, 228); font-family: Muli; clear: both; color: rgb(51, 51, 51); font-size: 18px;\"></p><h3 style=\"padding: 5px 0px; margin-right: 0px; margin-bottom: 0px; margin-left: 0px; border: 0px solid rgb(228, 228, 228); font-family: Asap; color: rgb(236, 0, 142); font-size: 21.6px;\">Our Mission</h3><p><br style=\"padding: 0px; margin: 0px; border: 0px solid rgb(228, 228, 228); font-family: Muli; clear: both; color: rgb(51, 51, 51); font-size: 18px;\"><img src=\"https://www.girlfriendsocial.com/images/mission.jpg\" alt=\"Mission\" style=\"padding: 0px 4px 0px 0px; margin: 0px; border: 0px solid rgb(228, 228, 228); font-family: Muli; color: rgb(51, 51, 51); font-size: 18px; float: left;\"><span style=\"color: rgb(51, 51, 51); font-family: Muli; font-size: 18px;\">Girlfriend Social is a free website that helps women meet other women around the world to develop friendships with.</span></p><h3 style=\"padding: 5px 0px; margin-right: 0px; margin-bottom: 0px; margin-left: 0px; border: 0px solid rgb(228, 228, 228); font-family: Asap; color: rgb(236, 0, 142); font-size: 21.6px;\">We are the largest website for women only - where women of all ages and backgrounds can come to talk, share and bond to make new female friends.</h3><p><br style=\"padding: 0px; margin: 0px; border: 0px solid rgb(228, 228, 228); font-family: Muli; clear: both; color: rgb(51, 51, 51); font-size: 18px;\"><br style=\"padding: 0px; margin: 0px; border: 0px solid rgb(228, 228, 228); font-family: Muli; clear: both; color: rgb(51, 51, 51); font-size: 18px;\"><img src=\"https://www.girlfriendsocial.com/images/feedback.jpg\" alt=\"About our GFS team\" border=\"4\" style=\"padding: 0px; margin: 0px; border: 0px solid rgb(228, 228, 228); font-family: Muli; color: rgb(51, 51, 51); font-size: 18px;\"><span style=\"color: rgb(51, 51, 51); font-family: Muli; font-size: 18px;\"></span></p><h1 style=\"padding: 0px; margin-right: 0px; margin-bottom: 0px; margin-left: 0px; border: 0px solid rgb(228, 228, 228); font-family: Asap; font-size: 39.6px; color: rgb(51, 51, 51);\">Meet The GirlFriend Social Team</h1><h3 style=\"padding: 5px 0px; margin-right: 0px; margin-bottom: 0px; margin-left: 0px; border: 0px solid rgb(228, 228, 228); font-family: Asap; color: rgb(236, 0, 142); font-size: 21.6px;\">Founder and CEO</h3><p style=\"padding: 0px; margin-bottom: 11.5px; border: 0px solid rgb(228, 228, 228); font-family: Muli; color: rgb(51, 51, 51); font-size: 18px;\"></p><center style=\"padding: 0px; margin: 0px; border: 0px solid rgb(228, 228, 228); font-family: Muli; color: rgb(51, 51, 51); font-size: 18px;\"><img src=\"https://www.girlfriendsocial.com/images/Amandahead.png\" alt=\"Amanda Blain\" border=\"1\" style=\"padding: 0px; margin: 0px; border: 0px solid rgb(228, 228, 228);\"></center><p style=\"padding: 0px; margin-bottom: 11.5px; border: 0px solid rgb(228, 228, 228); font-family: Muli; color: rgb(51, 51, 51); font-size: 18px;\"></p><p align=\"justify\" style=\"padding: 0px; margin-bottom: 11.5px; border: 0px solid rgb(228, 228, 228); font-family: Muli; color: rgb(51, 51, 51); font-size: 18px;\"><span style=\"padding: 0px; margin: 0px; border: 0px solid rgb(228, 228, 228); font-weight: 700;\">Amanda Blain</span>&nbsp;-&nbsp;<a href=\"https://www.amandablain.com/\" style=\"padding: 0px; margin: 0px; border: 0px solid rgb(228, 228, 228); font-family: Muli; font-weight: 400; color: rgb(80, 185, 180); text-decoration: none; user-select: none;\">AmandaBlain.com</a>&nbsp;<a href=\"https://www.worldofgeekstuff.com/\" style=\"padding: 0px; margin: 0px; border: 0px solid rgb(228, 228, 228); font-family: Muli; font-weight: 400; color: rgb(80, 185, 180); text-decoration: none; user-select: none;\">WorldofGeekStuff.com</a><br style=\"padding: 0px; margin: 0px; border: 0px solid rgb(228, 228, 228); clear: both;\">Amanda is the driving force behind Girlfriend Social. She currently lives in Toronto, Ontario, Canada. She\'s the one that has done every single part of the website you see here - from full stack development to marketing and support. With an ever-growing base of fans across all social media channels, she is a tour-de-force in many technical areas, and social areas.<br style=\"padding: 0px; margin: 0px; border: 0px solid rgb(228, 228, 228); clear: both;\"></p><p style=\"padding: 0px; margin-bottom: 11.5px; border: 0px solid rgb(228, 228, 228); font-family: Muli; color: rgb(51, 51, 51); font-size: 18px;\"></p><h1 style=\"padding: 0px; margin-right: 0px; margin-bottom: 0px; margin-left: 0px; border: 0px solid rgb(228, 228, 228); font-family: Asap; font-size: 39.6px; color: rgb(51, 51, 51);\">Testimonials</h1><p><span style=\"padding: 0px; margin: 0px; border: 0px solid rgb(228, 228, 228); font-family: Muli; font-weight: 700; color: rgb(51, 51, 51); font-size: 18px;\"><img src=\"https://www.girlfriendsocial.com/images/melissa.png\" alt=\"Melissa\" style=\"padding: 0px 4px 0px 0px; margin: 0px; border: 0px solid rgb(228, 228, 228); float: left;\">\"I have met a wonderful group of ladies in here. I have to tell you this website was a Godsend. I am so glad to have stumbled upon it. I have made some very nice new friends...which we all know is very hard to do these days, plus the events are great!\" ~&nbsp;<font color=\"#CC0066\" style=\"padding: 0px; margin: 0px; border: 0px solid rgb(228, 228, 228);\">Lyndia</font><br style=\"padding: 0px; margin: 0px; border: 0px solid rgb(228, 228, 228); clear: both;\">\"My husband was just transferred to a new city. I am a stay at home mom with little way to meet new people. You don\'t know how much your site has helped me! I have met other women who are going through the same thing. One even lives just over a few streets, who knew?! Thank you again.\"~&nbsp;<font color=\"#CC0066\" style=\"padding: 0px; margin: 0px; border: 0px solid rgb(228, 228, 228);\">Melissa</font><br style=\"padding: 0px; margin: 0px; border: 0px solid rgb(228, 228, 228); clear: both;\"><br style=\"padding: 0px; margin: 0px; border: 0px solid rgb(228, 228, 228); clear: both;\">\"Thank you so much for creating this site. I no longer feel so alone!\" ~&nbsp;<font color=\"#CC0066\" style=\"padding: 0px; margin: 0px; border: 0px solid rgb(228, 228, 228);\">Katie</font></span><span style=\"color: rgb(51, 51, 51); font-family: Muli; font-size: 18px;\"></span><br style=\"padding: 0px; margin: 0px; border: 0px solid rgb(228, 228, 228); font-family: Muli; clear: both; color: rgb(51, 51, 51); font-size: 18px;\"><a href=\"https://www.girlfriendsocial.com/testimonials/\" style=\"padding: 0px; margin: 0px; border: 0px solid rgb(228, 228, 228); font-family: Muli; font-weight: 400; color: rgb(80, 185, 180); text-decoration: none; user-select: none; font-size: 18px; background-color: rgb(255, 255, 255);\">Click here to read hundreds of Girlfriend Social reviews from our members</a><span style=\"color: rgb(51, 51, 51); font-family: Muli; font-size: 18px;\"></span><br style=\"padding: 0px; margin: 0px; border: 0px solid rgb(228, 228, 228); font-family: Muli; clear: both; color: rgb(51, 51, 51); font-size: 18px;\"><br style=\"padding: 0px; margin: 0px; border: 0px solid rgb(228, 228, 228); font-family: Muli; clear: both; color: rgb(51, 51, 51); font-size: 18px;\"></p><h3 style=\"padding: 5px 0px; margin-right: 0px; margin-bottom: 0px; margin-left: 0px; border: 0px solid rgb(228, 228, 228); font-family: Asap; color: rgb(236, 0, 142); font-size: 21.6px;\">Our Local Commitment</h3><p style=\"padding: 0px; margin-bottom: 11.5px; border: 0px solid rgb(228, 228, 228); font-family: Muli; color: rgb(51, 51, 51); font-size: 18px;\">Girlfriend Social, based in Toronto, Ontario, Canada, is currently available for women all over the world. What are you waiting for? You could be meeting new women in just a few minutes.</p><p><img src=\"data:image/jpeg;base64,\" style=\"width: 763.576px;\" data-filename=\"dashboard.jpg\"><br></p>', '2022-08-08 05:29:33', '2022-08-08 05:30:04');
