(6, 'Career', 'career', NULL, '<p><img src=\"https://www.girlfriendsocial.com/images/volunteer1.jpg\" border=\"0\" style=\"padding: 0px; margin: 0px; border: 0px solid rgb(228, 228, 228); font-family: Muli; color: rgb(51, 51, 51); font-size: 18px; float: right;\"></p><h2 style=\"padding: 0px; margin-right: 0px; margin-bottom: 10px; margin-left: 0px; border: 0px solid rgb(228, 228, 228); font-family: Asap; color: rgb(236, 0, 142); font-size: 27px;\"><i style=\"padding: 0px; margin: 0px; border: 0px solid rgb(228, 228, 228);\">Help? Why Does GFS Need Help?</i></h2><p><span style=\"color: rgb(51, 51, 51); font-family: Muli; font-size: 18px;\">Many women are shocked to find out that&nbsp;</span><span style=\"padding: 0px; margin: 0px; border: 0px solid rgb(228, 228, 228); font-family: Muli; font-weight: 700; color: rgb(51, 51, 51); font-size: 18px;\">Girlfriend Social is not backed or run by large corporations</span><span style=\"color: rgb(51, 51, 51); font-family: Muli; font-size: 18px;\">. This website is free for members. This means that 99% of the creation and coding of the website, features and requests are currently done purely on a volunteer basis, by a really small team of people. Usually just Amanda - and a few volunteer forum moderators. We\'ve got tons of data on our servers, so the costs and time to take care of everything here really does add up!</span><br style=\"padding: 0px; margin: 0px; border: 0px solid rgb(228, 228, 228); font-family: Muli; clear: both; color: rgb(51, 51, 51); font-size: 18px;\"><span style=\"color: rgb(51, 51, 51); font-family: Muli; font-size: 18px;\">We need your help so women everywhere can make female friends...!!</span><br style=\"padding: 0px; margin: 0px; border: 0px solid rgb(228, 228, 228); font-family: Muli; clear: both; color: rgb(51, 51, 51); font-size: 18px;\"><br style=\"padding: 0px; margin: 0px; border: 0px solid rgb(228, 228, 228); font-family: Muli; clear: both; color: rgb(51, 51, 51); font-size: 18px;\"></p><h2 style=\"padding: 0px; margin-right: 0px; margin-bottom: 10px; margin-left: 0px; border: 0px solid rgb(228, 228, 228); font-family: Asap; color: rgb(236, 0, 142); font-size: 27px;\"><i style=\"padding: 0px; margin: 0px; border: 0px solid rgb(228, 228, 228);\">Spread the Word</i></h2><ul style=\"padding: 0px; margin-right: 0px; margin-bottom: 0px; margin-left: 0px; border: 0px solid rgb(228, 228, 228); font-family: Muli; list-style-type: none; color: rgb(51, 51, 51); font-size: 18px;\"><li style=\"padding: 0px; margin: 0px; border: 0px solid rgb(228, 228, 228);\">Everyone can do this one... The easiest way is to help spread the word by telling your friends, family, and coworkers. If you want you a simple \"I just joined this cool website for women to make friends https://www.girlfriendsocial.com\" As a facebook, or twitter status update makes a world of difference! Use the buttons below to do it right now..</li><br style=\"padding: 0px; margin: 0px; border: 0px solid rgb(228, 228, 228); clear: both;\"><a target=\"_blank\" href=\"http://ctt.ec/Ek4Ia\" style=\"padding: 0px; margin: 0px; border: 0px solid rgb(228, 228, 228); font-family: Muli; font-weight: 400; color: rgb(80, 185, 180); text-decoration: none; user-select: none;\"><img src=\"http://clicktotweet.com/img/tweet-graphic-4.png\" alt=\"Tweet: Ladies are you - Bored? Lonely? Want to get out of the house more? Join Girlfriend Social for free - http://ctt.ec/Ek4Ia+ \" style=\"padding: 0px; margin: 0px; border: 0px solid rgb(228, 228, 228);\"></a>&nbsp;<div class=\"fb-share-button fb_iframe_widget\" data-href=\"http://www.girlfriendsocial.com\" data-layout=\"button\" data-size=\"large\" data-mobile-iframe=\"true\" fb-xfbml-state=\"rendered\" fb-iframe-plugin-query=\"app_id=110664345620592&amp;container_width=1210&amp;href=http%3A%2F%2Fwww.girlfriendsocial.com%2F&amp;layout=button&amp;locale=en_US&amp;mobile_iframe=true&amp;sdk=joey&amp;size=large\" style=\"padding: 0px; margin: 0px; border: 0px solid rgb(228, 228, 228); color: rgb(51, 51, 51); display: inline-block; position: relative;\"><span style=\"padding: 0px; margin: 0px; border: 0px solid rgb(228, 228, 228); display: inline-block; position: relative; text-align: justify; vertical-align: bottom; width: 77px; height: 28px;\"><iframe name=\"f1ce3229804d85c\" width=\"1000px\" height=\"1000px\" data-testid=\"fb:share_button Facebook Social Plugin\" title=\"fb:share_button Facebook Social Plugin\" frameborder=\"0\" allowtransparency=\"true\" allowfullscreen=\"true\" scrolling=\"no\" allow=\"encrypted-media\" src=\"https://www.facebook.com/v2.8/plugins/share_button.php?app_id=110664345620592&amp;channel=https%3A%2F%2Fstaticxx.facebook.com%2Fx%2Fconnect%2Fxd_arbiter%2F%3Fversion%3D46%23cb%3Df26cec7215a10e4%26domain%3Dwww.girlfriendsocial.com%26is_canvas%3Dfalse%26origin%3Dhttps%253A%252F%252Fwww.girlfriendsocial.com%252Ff4c558182fb3c%26relation%3Dparent.parent&amp;container_width=1210&amp;href=http%3A%2F%2Fwww.girlfriendsocial.com%2F&amp;layout=button&amp;locale=en_US&amp;mobile_iframe=true&amp;sdk=joey&amp;size=large\" class=\"\" style=\"padding: 0px; margin: 0px; border-width: initial; border-style: none; position: absolute; visibility: visible; width: 77px; height: 28px;\"></iframe></span></div><br style=\"padding: 0px; margin: 0px; border: 0px solid rgb(228, 228, 228); clear: both;\"><br style=\"padding: 0px; margin: 0px; border: 0px solid rgb(228, 228, 228); clear: both;\"></ul><h2 style=\"padding: 0px; margin-right: 0px; margin-bottom: 10px; margin-left: 0px; border: 0px solid rgb(228, 228, 228); font-family: Asap; color: rgb(236, 0, 142); font-size: 27px;\"><i style=\"padding: 0px; margin: 0px; border: 0px solid rgb(228, 228, 228);\">Print Out Our Flyer</i></h2><p><span style=\"color: rgb(51, 51, 51); font-family: Muli; font-size: 18px;\">Not too many women in your area? Print out our flyer(</span><a href=\"https://www.girlfriendsocial.com/pages/flyer/\" style=\"padding: 0px; margin: 0px; border: 0px solid rgb(228, 228, 228); font-family: Muli; font-weight: 400; color: rgb(80, 185, 180); text-decoration: none; user-select: none; font-size: 18px;\">click here to see it and print it!</a><span style=\"color: rgb(51, 51, 51); font-family: Muli; font-size: 18px;\">) and leave it at the local grocery store, your gym, fitness class or on a sign post downtown. You wont have to approach anyone, but trust us you\'ll notice women in your area signing up!</span><br style=\"padding: 0px; margin: 0px; border: 0px solid rgb(228, 228, 228); font-family: Muli; clear: both; color: rgb(51, 51, 51); font-size: 18px;\"><span style=\"color: rgb(51, 51, 51); font-family: Muli; font-size: 18px;\">Just click on the flyer and print it out in black and white or color and post at places you go. Women will sign up and we Thank you for helping spread the female friend power!</span><br style=\"padding: 0px; margin: 0px; border: 0px solid rgb(228, 228, 228); font-family: Muli; clear: both; color: rgb(51, 51, 51); font-size: 18px;\"></p><center style=\"padding: 0px; margin: 0px; border: 0px solid rgb(228, 228, 228); font-family: Muli; color: rgb(51, 51, 51); font-size: 18px;\"><h2 style=\"padding: 0px; margin-right: 0px; margin-bottom: 10px; margin-left: 0px; border: 0px solid rgb(228, 228, 228); font-family: Asap; color: rgb(236, 0, 142); font-size: 27px; letter-spacing: 0px;\">A BIG thank you to Jkitten20 for creating this flyer!</h2><a href=\"https://www.girlfriendsocial.com/pages/flyer\" style=\"padding: 0px; margin: 0px; border: 0px solid rgb(228, 228, 228); font-family: Muli; font-weight: 400; color: rgb(80, 185, 180); text-decoration: none; user-select: none;\"><img src=\"https://www.girlfriendsocial.com/images/banners/gfsflyer2.jpg\" height=\"400px\" width=\"400px\" border=\"0\" style=\"padding: 0px; margin: 0px; border: 0px solid rgb(228, 228, 228);\"><img src=\"https://www.girlfriendsocial.com/images/gfsflyer.JPG\" height=\"400px\" width=\"400px\" border=\"0\" style=\"padding: 0px; margin: 0px; border: 0px solid rgb(228, 228, 228);\"></a></center><p><br style=\"padding: 0px; margin: 0px; border: 0px solid rgb(228, 228, 228); font-family: Muli; clear: both; color: rgb(51, 51, 51); font-size: 18px;\"><br style=\"padding: 0px; margin: 0px; border: 0px solid rgb(228, 228, 228); font-family: Muli; clear: both; color: rgb(51, 51, 51); font-size: 18px;\"><img src=\"http://www.girlfriendsocial.com/public/admin/Media.jpg\" style=\"padding: 0px; margin: 0px; border: 0px solid rgb(228, 228, 228); font-family: Muli; color: rgb(51, 51, 51); font-size: 18px; float: left; width: 200px;\"></p><h2 style=\"padding: 0px; margin-right: 0px; margin-bottom: 10px; margin-left: 0px; border: 0px solid rgb(228, 228, 228); font-family: Asap; color: rgb(236, 0, 142); font-size: 27px;\"><i style=\"padding: 0px; margin: 0px; border: 0px solid rgb(228, 228, 228);\">Content Creator or Media Connections?</i></h2><p style=\"padding: 0px; margin-bottom: 11.5px; border: 0px solid rgb(228, 228, 228); font-family: Muli; color: rgb(51, 51, 51); font-size: 18px;\">Do you have a Blog or Youtube? Why not write up about your GFS experience or post a link back to the site? Or maybe you have some media connections? Do you have a friend from high school involved in the press? A gal pal who is a reporter or blogger herself? Your aunt or friend runs a female oriented business like a yoga studio, book club, or hair salon? (There may be ways we can work together..) Please drop our name and mention what a great female positive story idea Girlfriend Social is... or&nbsp;<a href=\"http://www.girlfriendsocial.com/help/contact\" style=\"padding: 0px; margin: 0px; border: 0px solid rgb(228, 228, 228); font-family: Muli; font-weight: 400; color: rgb(80, 185, 180); text-decoration: none; user-select: none;\">send us their contact info and we\'ll take it from there!</a></p><p><br style=\"padding: 0px; margin: 0px; border: 0px solid rgb(228, 228, 228); font-family: Muli; clear: both; color: rgb(51, 51, 51); font-size: 18px;\"><br style=\"padding: 0px; margin: 0px; border: 0px solid rgb(228, 228, 228); font-family: Muli; clear: both; color: rgb(51, 51, 51); font-size: 18px;\"></p><h2 style=\"padding: 0px; margin-right: 0px; margin-bottom: 10px; margin-left: 0px; border: 0px solid rgb(228, 228, 228); font-family: Asap; color: rgb(236, 0, 142); font-size: 27px;\"><i style=\"padding: 0px; margin: 0px; border: 0px solid rgb(228, 228, 228);\">What can I do to Help and Still Have Some Fun? - Volunteer!</i></h2><p><span style=\"color: rgb(51, 51, 51); font-family: Muli; font-size: 18px;\">Volunteers get some unique privileges on the site and have a special volunteer badge shown on their profile.</span></p><div style=\"padding: 10px; margin: 5px 5px 5px 100px; border: 1px dotted rgb(204, 204, 204); font-family: Muli; font-size: 18px; color: rgb(51, 51, 51); background-image: none; background-position: 0% 0%; background-size: initial; background-repeat: repeat; background-attachment: scroll; background-origin: initial; background-clip: initial; width: 260px;\">If you are interested in any of these roles use the contact form on the bottom of every page or please email us at:<br style=\"padding: 0px; margin: 0px; border: 0px solid rgb(228, 228, 228); clear: both;\"><img src=\"https://www.girlfriendsocial.com/images/emailus.jpg\" border=\"0\" style=\"padding: 0px; margin: 0px; border: 0px solid rgb(228, 228, 228); float: left;\"><br style=\"padding: 0px; margin: 0px; border: 0px solid rgb(228, 228, 228); clear: both;\"></div><p><span style=\"padding: 0px; margin: 0px; border: 0px solid rgb(228, 228, 228); font-family: Muli; font-weight: 700; color: rgb(51, 51, 51); font-size: 18px;\">We are looking for Volunteers in the Following Areas:</span><br style=\"padding: 0px; margin: 0px; border: 0px solid rgb(228, 228, 228); font-family: Muli; clear: both; color: rgb(51, 51, 51); font-size: 18px;\"><br style=\"padding: 0px; margin: 0px; border: 0px solid rgb(228, 228, 228); font-family: Muli; clear: both; color: rgb(51, 51, 51); font-size: 18px;\"><span style=\"padding: 0px; margin: 0px; border: 0px solid rgb(228, 228, 228); font-family: Muli; font-weight: 700; color: rgb(51, 51, 51); font-size: 18px;\">Graphic Artist:</span><span style=\"color: rgb(51, 51, 51); font-family: Muli; font-size: 18px;\">&nbsp;Girlfriend Social could use your help creating fun posters, cards, and other promotional media that women can print out to advertise the website in their local area. Time is flexible and submit when you can! Email us with the subject - Graphic Artist Role.</span><br style=\"padding: 0px; margin: 0px; border: 0px solid rgb(228, 228, 228); font-family: Muli; clear: both; color: rgb(51, 51, 51); font-size: 18px;\"><br style=\"padding: 0px; margin: 0px; border: 0px solid rgb(228, 228, 228); font-family: Muli; clear: both; color: rgb(51, 51, 51); font-size: 18px;\"><span style=\"padding: 0px; margin: 0px; border: 0px solid rgb(228, 228, 228); font-family: Muli; font-weight: 700; color: rgb(51, 51, 51); font-size: 18px;\">GFS Greeter:</span><span style=\"color: rgb(51, 51, 51); font-family: Muli; font-size: 18px;\">&nbsp;Getting familiar with the website? The GFS Greeter will simply write a message to new members in their local areas and Let them know you are there to help. (with things like where is the message button or how do i attend events). This position doesn\'t take much time at all and is a great way to meet new friends in your area at the same time! Email us with the subject - GFS Greeter</span><br style=\"padding: 0px; margin: 0px; border: 0px solid rgb(228, 228, 228); font-family: Muli; clear: both; color: rgb(51, 51, 51); font-size: 18px;\"><br style=\"padding: 0px; margin: 0px; border: 0px solid rgb(228, 228, 228); font-family: Muli; clear: both; color: rgb(51, 51, 51); font-size: 18px;\"><span style=\"padding: 0px; margin: 0px; border: 0px solid rgb(228, 228, 228); font-family: Muli; font-weight: 700; color: rgb(51, 51, 51); font-size: 18px;\">Spell Checking:</span><span style=\"color: rgb(51, 51, 51); font-family: Muli; font-size: 18px;\">&nbsp;There are LOTS of spelling errors in the core section of the site (Hey we are not perfect!). If you want to help spellcheck, simply pick a \"core GFS page\" (not someone\'s profile or discussion post etc) and simply tell us the errors and the page. Do it once or do it semi regularly! Email us with the subject - Spelling Correction</span><br style=\"padding: 0px; margin: 0px; border: 0px solid rgb(228, 228, 228); font-family: Muli; clear: both; color: rgb(51, 51, 51); font-size: 18px;\"><br style=\"padding: 0px; margin: 0px; border: 0px solid rgb(228, 228, 228); font-family: Muli; clear: both; color: rgb(51, 51, 51); font-size: 18px;\"><img src=\"https://www.girlfriendsocial.com/images/guestblog.jpg\" border=\"0\" style=\"padding: 0px; margin: 0px; border: 0px solid rgb(228, 228, 228); font-family: Muli; color: rgb(51, 51, 51); font-size: 18px; float: left;\"><span style=\"padding: 0px; margin: 0px; border: 0px solid rgb(228, 228, 228); font-family: Muli; font-weight: 700; color: rgb(51, 51, 51); font-size: 18px;\">Forum Monitor:</span><span style=\"color: rgb(51, 51, 51); font-family: Muli; font-size: 18px;\">&nbsp;Like reading the forums? We need a lady who will navigate the forums for spam, ladies needing help, advertisements, ladies being mean etc. Also creating new topics for ladies to chat about. You will be granted great powers of deleting and get special titles in the forum! Pick one category or a few. This position needs someone who will do it semi regularly.&nbsp;</span><a href=\"http://www.girlfriendsocial.com/help/contact\" style=\"padding: 0px; margin: 0px; border: 0px solid rgb(228, 228, 228); font-family: Muli; font-weight: 400; color: rgb(80, 185, 180); text-decoration: none; user-select: none; font-size: 18px;\">Email us with subject&nbsp;</a><span style=\"color: rgb(51, 51, 51); font-family: Muli; font-size: 18px;\">-Forum Moderator.</span><br style=\"padding: 0px; margin: 0px; border: 0px solid rgb(228, 228, 228); font-family: Muli; clear: both; color: rgb(51, 51, 51); font-size: 18px;\"><br style=\"padding: 0px; margin: 0px; border: 0px solid rgb(228, 228, 228); font-family: Muli; clear: both; color: rgb(51, 51, 51); font-size: 18px;\"><span style=\"padding: 0px; margin: 0px; border: 0px solid rgb(228, 228, 228); font-family: Muli; font-weight: 700; color: rgb(51, 51, 51); font-size: 18px;\">Writer:&nbsp;</span><span style=\"color: rgb(51, 51, 51); font-family: Muli; font-size: 18px;\">If you are a writer about any female topic or interest (thats pretty much everything) consider submitting some guest articles to the GFS blog.&nbsp;</span><a href=\"https://www.girlfriendsocial.com/blog/\" style=\"padding: 0px; margin: 0px; border: 0px solid rgb(228, 228, 228); font-family: Muli; font-weight: 400; color: rgb(80, 185, 180); text-decoration: none; user-select: none; font-size: 18px;\">Check out the blog here</a><span style=\"color: rgb(51, 51, 51); font-family: Muli; font-size: 18px;\">&nbsp;and then Email us with the subject - Guest GFS Author.</span><br style=\"padding: 0px; margin: 0px; border: 0px solid rgb(228, 228, 228); font-family: Muli; clear: both; color: rgb(51, 51, 51); font-size: 18px;\"><br style=\"padding: 0px; margin: 0px; border: 0px solid rgb(228, 228, 228); font-family: Muli; clear: both; color: rgb(51, 51, 51); font-size: 18px;\"></p><h2 style=\"padding: 0px; margin-right: 0px; margin-bottom: 10px; margin-left: 0px; border: 0px solid rgb(228, 228, 228); font-family: Asap; color: rgb(236, 0, 142); font-size: 27px;\"><i style=\"padding: 0px; margin: 0px; border: 0px solid rgb(228, 228, 228);\">Upgrade Instead...</i></h2><center style=\"padding: 0px; margin: 0px; border: 0px solid rgb(228, 228, 228); font-family: Muli; color: rgb(51, 51, 51); font-size: 18px;\"><img src=\"http://www.girlfriendsocial.com/public/admin/Diamond.jpg\" style=\"padding: 0px; margin: 0px; border: 0px solid rgb(228, 228, 228);\"><img src=\"http://www.girlfriendsocial.com/public/admin/Gold.png\" style=\"padding: 0px; margin: 0px; border: 0px solid rgb(228, 228, 228);\"></center><p><span style=\"padding: 0px; margin: 0px; border: 0px solid rgb(228, 228, 228); font-family: Muli; font-weight: 700; color: rgb(51, 51, 51); font-size: 18px;\">Upgrade:&nbsp;</span><span style=\"color: rgb(51, 51, 51); font-family: Muli; font-size: 18px;\">If you would rather support the website with some money instead of your time and get some cool friendship search features at the same time... please check out how to&nbsp;</span><a href=\"https://www.girlfriendsocial.com/pages/upgrade/\" style=\"padding: 0px; margin: 0px; border: 0px solid rgb(228, 228, 228); font-family: Muli; font-weight: 400; color: rgb(80, 185, 180); text-decoration: none; user-select: none; font-size: 18px;\">upgrade your account to a Gold or Diamond Member</a><span style=\"color: rgb(51, 51, 51); font-family: Muli; font-size: 18px;\">. These funds are put directly back into making the website better&nbsp;</span><span style=\"padding: 0px; margin: 0px; border: 0px solid rgb(228, 228, 228); font-family: Muli; font-weight: 700; color: rgb(51, 51, 51); font-size: 18px;\">including advertising in your local area</span><span style=\"color: rgb(51, 51, 51); font-family: Muli; font-size: 18px;\">&nbsp;and new and additional features that ONLY gold/diamond get value</span><span style=\"color: rgb(51, 51, 51); font-family: Muli; font-size: 18px;\">.</span><br style=\"padding: 0px; margin: 0px; border: 0px solid rgb(228, 228, 228); font-family: Muli; clear: both; color: rgb(51, 51, 51); font-size: 18px;\"><br style=\"padding: 0px; margin: 0px; border: 0px solid rgb(228, 228, 228); font-family: Muli; clear: both; color: rgb(51, 51, 51); font-size: 18px;\"></p><div style=\"padding: 10px; margin: 5px 5px 5px 100px; border: 1px dotted rgb(204, 204, 204); font-family: Muli; font-size: 18px; color: rgb(51, 51, 51); background-image: none; background-position: 0% 0%; background-size: initial; background-repeat: repeat; background-attachment: scroll; background-origin: initial; background-clip: initial; width: 260px;\">If you are interested in any of these roles please use the contact form on the bottom of every page or email us at:<br style=\"padding: 0px; margin: 0px; border: 0px solid rgb(228, 228, 228); clear: both;\"><img src=\"https://www.girlfriendsocial.com/images/emailus.jpg\" border=\"0\" style=\"padding: 0px; margin: 0px; border: 0px solid rgb(228, 228, 228); float: left;\"><br style=\"padding: 0px; margin: 0px; border: 0px solid rgb(228, 228, 228); clear: both;\"></div><h4 style=\"padding: 10px 0px; margin-right: 0px; margin-bottom: 10px; margin-left: 0px; border-image: initial; border-style: solid; border-width: 0px 0px 1px; border-color: rgb(228, 228, 228); font-family: Asap; color: rgb(236, 0, 142); font-size: 16.2px;\">Paid Positions at Girlfriend Social</h4><p><span style=\"color: rgb(51, 51, 51); font-family: Muli; font-size: 18px;\">We currently do not have any paid roles available at this time. Check back soon.</span><br></p>', '2022-08-08 05:42:12', '2022-08-08 05:43:16'),
(7, 'Contact us', 'contact-us', NULL, '<h1 style=\"padding: 0px; margin-right: 0px; margin-bottom: 0px; margin-left: 0px; border: 0px solid rgb(228, 228, 228); font-family: Asap; font-size: 39.6px; color: rgb(51, 51, 51);\">Contact Us</h1><center style=\"padding: 0px; margin: 0px; border: 0px solid rgb(228, 228, 228); font-family: Muli; color: rgb(51, 51, 51); font-size: 18px;\"><img src=\"https://www.girlfriendsocial.com/public/admin/FAQ.jpg\" style=\"padding: 0px; margin: 0px; border: 0px solid rgb(228, 228, 228); width: 445.75px; height: 124.797px;\"><br style=\"padding: 0px; margin: 0px; border: 0px solid rgb(228, 228, 228); clear: both;\"></center><h2 style=\"padding: 0px; margin-right: 0px; margin-bottom: 10px; margin-left: 0px; border: 0px solid rgb(228, 228, 228); font-family: Asap; color: rgb(236, 0, 142); font-size: 27px;\">Need Some Help?</h2><center style=\"padding: 0px; margin: 0px; border: 0px solid rgb(228, 228, 228); font-family: Muli; color: rgb(51, 51, 51); font-size: 18px;\"><a href=\"http://www.girlfriendsocial.com/pages/FAQ\" style=\"padding: 0px; margin: 0px; border: 0px solid rgb(228, 228, 228); font-family: Muli; font-weight: 400; color: rgb(80, 185, 180); text-decoration: none; user-select: none; font-size: 32px;\">Read Girlfriend Social\'s FREQUENTLY ASKED QUESTIONS</a></center><p><br style=\"padding: 0px; margin: 0px; border: 0px solid rgb(228, 228, 228); font-family: Muli; clear: both; color: rgb(51, 51, 51); font-size: 18px;\"><span style=\"padding: 0px; margin: 0px; border: 0px solid rgb(228, 228, 228); font-family: Muli; font-weight: 700; color: rgb(51, 51, 51); font-size: 18px;\">Want to know How to Delete Your Account, Change Your Email, Reset Your Password, If you got a message but can\'t find it now, The best way to find friends... and many other common questions</span><span style=\"color: rgb(51, 51, 51); font-family: Muli; font-size: 18px;\">&nbsp;are all listed. If your questions is asked in our&nbsp;</span><a href=\"http://www.girlfriendsocial.com/pages/FAQ\" style=\"padding: 0px; margin: 0px; border: 0px solid rgb(228, 228, 228); font-family: Muli; font-weight: 400; color: rgb(80, 185, 180); text-decoration: none; user-select: none; font-size: 18px;\">FAQ</a><span style=\"color: rgb(51, 51, 51); font-family: Muli; font-size: 18px;\">&nbsp;you will not receive a response from this contact form.</span><br style=\"padding: 0px; margin: 0px; border: 0px solid rgb(228, 228, 228); font-family: Muli; clear: both; color: rgb(51, 51, 51); font-size: 18px;\"><br style=\"padding: 0px; margin: 0px; border: 0px solid rgb(228, 228, 228); font-family: Muli; clear: both; color: rgb(51, 51, 51); font-size: 18px;\"><span style=\"color: rgb(51, 51, 51); font-family: Muli; font-size: 18px;\">We are a free to use website and run by volunteers, we simply do not have the resources to respond to all requests. That\'s why we created a page with the most common ones. If you questions is not listed on our&nbsp;</span><a href=\"http://www.girlfriendsocial.com/pages/FAQ\" style=\"padding: 0px; margin: 0px; border: 0px solid rgb(228, 228, 228); font-family: Muli; font-weight: 400; color: rgb(80, 185, 180); text-decoration: none; user-select: none; font-size: 18px;\">FAQ</a><span style=\"color: rgb(51, 51, 51); font-family: Muli; font-size: 18px;\">&nbsp;if applicable, we will get back to you as soon as we can.</span><br></p>', '2022-08-08 05:46:34', '2022-08-08 05:46:34');

