INSERT INTO `testimonials` (`id`, `name`, `feedback`, `profile`, `created_at`, `updated_at`) VALUES
(1, 'Chipmunkmom', 'I am delighted to share that I have been able to befriend a really nice person who has a lot in common with me. We are having so much fun sharing our life stories. We live too far away to meet but our pen pal relationship continues to grow each week. Don\'t give up. friendships here can happen.', '1659901358dashboard.jpg', '2022-08-07 14:42:38', '2022-08-07 14:42:38'),
(2, 'Andellaz', 'I went to school for 7 years and was so busy with work and academics that I didn\'t make any friends post High School. So, I signed up for GFS. I didn\'t think I would meet anyone who was serious enough to build a friendship, but I was very wrong. Just after a few months on the site, I found two very good friends. I am very happy to have utilized this friend-making source!', '1659901990LIMS Brouche 1.JPG', '2022-08-07 14:53:11', '2022-08-07 14:53:11');

